classes:
  sdos_3DModel:
    class_uri: sdos:3DModel
    description: "A 3D model represents some kind of 3D content, which may have [[encoding]]s\
      \ in one or more [[MediaObject]]s. Many 3D formats are available (e.g. see [Wikipedia](https://en.wikipedia.org/wiki/Category:3D_graphics_file_formats));\
      \ specific encoding formats can be represented using the [[encodingFormat]]\
      \ property applied to the relevant [[MediaObject]]. For the\u240Acase of a single\
      \ file published after Zip compression, the convention of appending '+zip' to\
      \ the [[encodingFormat]] can be used. Geospatial, AR/VR, artistic/animation,\
      \ gaming, engineering and scientific content can all be represented using [[3DModel]]."
    is_a: sdos_MediaObject
    name: sdos_3DModel
    source: https://github.com/schemaorg/schemaorg/issues/2140
    title: 3DModel
  sdos_AMRadioChannel:
    class_uri: sdos:AMRadioChannel
    description: A radio channel that uses AM.
    is_a: sdos_RadioChannel
    name: sdos_AMRadioChannel
    source: https://github.com/schemaorg/schemaorg/issues/1004
    title: AMRadioChannel
  sdos_APIReference:
    class_uri: sdos:APIReference
    description: Reference documentation for application programming interfaces (APIs).
    is_a: sdos_TechArticle
    name: sdos_APIReference
    title: APIReference
  sdos_AboutPage:
    class_uri: sdos:AboutPage
    description: 'Web page type: About page.'
    is_a: sdos_WebPage
    name: sdos_AboutPage
    title: AboutPage
  sdos_AcceptAction:
    class_uri: sdos:AcceptAction
    description: 'The act of committing to/adopting an object.\n\nRelated actions:\n\n*
      [[RejectAction]]: The antonym of AcceptAction.'
    is_a: sdos_AllocateAction
    name: sdos_AcceptAction
    title: AcceptAction
  sdos_Accommodation:
    class_uri: sdos:Accommodation
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: "An accommodation is a place that can accommodate human beings, e.g.\
      \ a hotel room, a camping pitch, or a meeting room. Many accommodations are\
      \ for overnight stays, but this is not a mandatory requirement.\u240AFor more\
      \ specific types of accommodations not defined in schema.org, one can use [[additionalType]]\
      \ with external vocabularies.\u240A<br /><br />\u240ASee also the <a href=\"\
      /docs/hotels.html\">dedicated document on the use of schema.org for marking\
      \ up hotels and other forms of accommodations</a>."
    is_a: sdos_Place
    name: sdos_Accommodation
    title: Accommodation
  sdos_AccountingService:
    class_uri: sdos:AccountingService
    description: Accountancy business.\n\nAs a [[LocalBusiness]] it can be described
      as a [[provider]] of one or more [[Service]]\(s).
    is_a: sdos_FinancialService
    name: sdos_AccountingService
    title: AccountingService
  sdos_AchieveAction:
    class_uri: sdos:AchieveAction
    description: The act of accomplishing something via previous efforts. It is an
      instantaneous action rather than an ongoing process.
    is_a: sdos_Action
    name: sdos_AchieveAction
    title: AchieveAction
  sdos_Action:
    class_uri: sdos:Action
    contributors:
    - https://schema.org/docs/collab/ActionCollabClass
    description: An action performed by a direct agent and indirect participants upon
      a direct object. Optionally happens at a location with the help of an inanimate
      instrument. The execution of the action may produce a result. Specific action
      sub-type documentation specifies the exact expectation of each argument/role.\n\nSee
      also [blog post](http://blog.schema.org/2014/04/announcing-schemaorg-actions.html)
      and [Actions overview document](https://schema.org/docs/actions.html).
    is_a: sdos_Thing
    name: sdos_Action
    title: Action
  sdos_ActionAccessSpecification:
    class_uri: sdos:ActionAccessSpecification
    description: A set of requirements that must be fulfilled in order to perform
      an Action.
    is_a: sdos_Intangible
    name: sdos_ActionAccessSpecification
    source: https://github.com/schemaorg/schemaorg/issues/1741
    title: ActionAccessSpecification
  sdos_ActionStatusType:
    class_uri: sdos:ActionStatusType
    description: The status of an Action.
    is_a: sdos_StatusEnumeration
    name: sdos_ActionStatusType
    slots:
    - rdfs_comment
    - rdfs_label
    title: ActionStatusType
  sdos_ActivateAction:
    class_uri: sdos:ActivateAction
    description: The act of starting or activating a device or application (e.g. starting
      a timer or turning on a flashlight).
    is_a: sdos_ControlAction
    name: sdos_ActivateAction
    title: ActivateAction
  sdos_AddAction:
    class_uri: sdos:AddAction
    description: The act of editing by adding an object to a collection.
    is_a: sdos_UpdateAction
    name: sdos_AddAction
    title: AddAction
  sdos_AdministrativeArea:
    class_uri: sdos:AdministrativeArea
    description: A geographical region, typically under the jurisdiction of a particular
      government.
    is_a: sdos_Place
    name: sdos_AdministrativeArea
    title: AdministrativeArea
  sdos_AdultEntertainment:
    class_uri: sdos:AdultEntertainment
    description: An adult entertainment establishment.
    is_a: sdos_EntertainmentBusiness
    name: sdos_AdultEntertainment
    title: AdultEntertainment
  sdos_AdultOrientedEnumeration:
    class_uri: sdos:AdultOrientedEnumeration
    description: Enumeration of considerations that make a product relevant or potentially
      restricted for adults only.
    is_a: sdos_Enumeration
    name: sdos_AdultOrientedEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2989
    title: AdultOrientedEnumeration
  sdos_AdvertiserContentArticle:
    class_uri: sdos:AdvertiserContentArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: An [[Article]] that an external entity has paid to place or to produce
      to its specifications. Includes [advertorials](https://en.wikipedia.org/wiki/Advertorial),
      sponsored content, native advertising and other paid content.
    is_a: sdos_Article
    name: sdos_AdvertiserContentArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: AdvertiserContentArticle
  sdos_AggregateOffer:
    class_uri: sdos:AggregateOffer
    description: 'When a single product is associated with multiple offers (for example,
      the same pair of shoes is offered by different merchants), then AggregateOffer
      can be used.\n\nNote: AggregateOffers are normally expected to associate multiple
      offers that all share the same defined [[businessFunction]] value, or default
      to http://purl.org/goodrelations/v1#Sell if businessFunction is not explicitly
      defined.'
    is_a: sdos_Offer
    name: sdos_AggregateOffer
    title: AggregateOffer
  sdos_AggregateRating:
    class_uri: sdos:AggregateRating
    description: The average rating based on multiple ratings or reviews.
    is_a: sdos_Rating
    name: sdos_AggregateRating
    title: AggregateRating
  sdos_AgreeAction:
    class_uri: sdos:AgreeAction
    description: The act of expressing a consistency of opinion with the object. An
      agent agrees to/about an object (a proposition, topic or theme) with participants.
    is_a: sdos_ReactAction
    name: sdos_AgreeAction
    title: AgreeAction
  sdos_Airline:
    class_uri: sdos:Airline
    description: An organization that provides flights for passengers.
    is_a: sdos_Organization
    name: sdos_Airline
    title: Airline
  sdos_Airport:
    class_uri: sdos:Airport
    description: An airport.
    is_a: sdos_CivicStructure
    name: sdos_Airport
    title: Airport
  sdos_AlignmentObject:
    class_uri: sdos:AlignmentObject
    contributors:
    - https://schema.org/docs/collab/LRMIClass
    description: "An intangible item that describes an alignment between a learning\
      \ resource and a node in an educational framework.\u240A\u240AShould not be\
      \ used where the nature of the alignment can be described using a simple property,\
      \ for example to express that a resource [[teaches]] or [[assesses]] a competency."
    is_a: sdos_Intangible
    name: sdos_AlignmentObject
    title: AlignmentObject
  sdos_AllocateAction:
    class_uri: sdos:AllocateAction
    description: The act of organizing tasks/objects/events by associating resources
      to it.
    is_a: sdos_OrganizeAction
    name: sdos_AllocateAction
    title: AllocateAction
  sdos_AmpStory:
    class_uri: sdos:AmpStory
    description: A creative work with a visual storytelling format intended to be
      viewed online, particularly on mobile devices.
    is_a: sdos_MediaObject
    name: sdos_AmpStory
    source: https://github.com/schemaorg/schemaorg/issues/2646
    title: AmpStory
  sdos_AmusementPark:
    class_uri: sdos:AmusementPark
    description: An amusement park.
    is_a: sdos_EntertainmentBusiness
    name: sdos_AmusementPark
    title: AmusementPark
  sdos_AnalysisNewsArticle:
    class_uri: sdos:AnalysisNewsArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: An AnalysisNewsArticle is a [[NewsArticle]] that, while based on
      factual reporting, incorporates the expertise of the author/producer, offering
      interpretations and conclusions.
    is_a: sdos_NewsArticle
    name: sdos_AnalysisNewsArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: AnalysisNewsArticle
  sdos_AnatomicalStructure:
    class_uri: sdos:AnatomicalStructure
    description: Any part of the human body, typically a component of an anatomical
      system. Organs, tissues, and cells are all anatomical structures.
    is_a: sdos_MedicalEntity
    name: sdos_AnatomicalStructure
    title: AnatomicalStructure
  sdos_AnatomicalSystem:
    class_uri: sdos:AnatomicalSystem
    description: An anatomical system is a group of anatomical structures that work
      together to perform a certain task. Anatomical systems, such as organ systems,
      are one organizing principle of anatomy, and can include circulatory, digestive,
      endocrine, integumentary, immune, lymphatic, muscular, nervous, reproductive,
      respiratory, skeletal, urinary, vestibular, and other systems.
    is_a: sdos_MedicalEntity
    name: sdos_AnatomicalSystem
    title: AnatomicalSystem
  sdos_AnimalShelter:
    class_uri: sdos:AnimalShelter
    description: Animal shelter.
    is_a: sdos_LocalBusiness
    name: sdos_AnimalShelter
    title: AnimalShelter
  sdos_Answer:
    class_uri: sdos:Answer
    contributors:
    - https://schema.org/docs/collab/QAStackExchange
    description: An answer offered to a question; perhaps correct, perhaps opinionated
      or wrong.
    is_a: sdos_Comment
    name: sdos_Answer
    title: Answer
  sdos_Apartment:
    class_uri: sdos:Apartment
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: 'An apartment (in American English) or flat (in British English)
      is a self-contained housing unit (a type of residential real estate) that occupies
      only part of a building (source: Wikipedia, the free encyclopedia, see <a href="http://en.wikipedia.org/wiki/Apartment">http://en.wikipedia.org/wiki/Apartment</a>).'
    is_a: sdos_Accommodation
    name: sdos_Apartment
    title: Apartment
  sdos_ApartmentComplex:
    class_uri: sdos:ApartmentComplex
    description: 'Residence type: Apartment complex.'
    is_a: sdos_Residence
    name: sdos_ApartmentComplex
    title: ApartmentComplex
  sdos_AppendAction:
    class_uri: sdos:AppendAction
    description: The act of inserting at the end if an ordered collection.
    is_a: sdos_InsertAction
    name: sdos_AppendAction
    title: AppendAction
  sdos_ApplyAction:
    class_uri: sdos:ApplyAction
    description: 'The act of registering to an organization/service without the guarantee
      to receive it.\n\nRelated actions:\n\n* [[RegisterAction]]: Unlike RegisterAction,
      ApplyAction has no guarantees that the application will be accepted.'
    is_a: sdos_OrganizeAction
    name: sdos_ApplyAction
    title: ApplyAction
  sdos_ApprovedIndication:
    class_uri: sdos:ApprovedIndication
    description: An indication for a medical therapy that has been formally specified
      or approved by a regulatory body that regulates use of the therapy; for example,
      the US FDA approves indications for most drugs in the US.
    is_a: sdos_MedicalIndication
    name: sdos_ApprovedIndication
    title: ApprovedIndication
  sdos_Aquarium:
    class_uri: sdos:Aquarium
    description: Aquarium.
    is_a: sdos_CivicStructure
    name: sdos_Aquarium
    title: Aquarium
  sdos_ArchiveComponent:
    class_uri: sdos:ArchiveComponent
    description: An intangible type to be applied to any archive content, carrying
      with it a set of properties required to describe archival items and collections.
    is_a: sdos_CreativeWork
    name: sdos_ArchiveComponent
    source: https://github.com/schemaorg/schemaorg/issues/1758
    title: ArchiveComponent
  sdos_ArchiveOrganization:
    class_uri: sdos:ArchiveOrganization
    description: An organization with archival holdings. An organization which keeps
      and preserves archival material and typically makes it accessible to the public.
    is_a: sdos_LocalBusiness
    name: sdos_ArchiveOrganization
    source: https://github.com/schemaorg/schemaorg/issues/1758
    title: ArchiveOrganization
  sdos_ArriveAction:
    class_uri: sdos:ArriveAction
    description: The act of arriving at a place. An agent arrives at a destination
      from a fromLocation, optionally with participants.
    is_a: sdos_MoveAction
    name: sdos_ArriveAction
    title: ArriveAction
  sdos_ArtGallery:
    class_uri: sdos:ArtGallery
    description: An art gallery.
    is_a: sdos_EntertainmentBusiness
    name: sdos_ArtGallery
    title: ArtGallery
  sdos_Artery:
    class_uri: sdos:Artery
    description: A type of blood vessel that specifically carries blood away from
      the heart.
    is_a: sdos_Vessel
    name: sdos_Artery
    title: Artery
  sdos_Article:
    class_uri: sdos:Article
    contributors:
    - https://schema.org/docs/collab/rNews
    description: An article, such as a news article or piece of investigative report.
      Newspapers and magazines have articles of many different types and this is intended
      to cover them all.\n\nSee also [blog post](http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html).
    is_a: sdos_CreativeWork
    name: sdos_Article
    title: Article
  sdos_AskAction:
    class_uri: sdos:AskAction
    description: 'The act of posing a question / favor to someone.\n\nRelated actions:\n\n*
      [[ReplyAction]]: Appears generally as a response to AskAction.'
    is_a: sdos_CommunicateAction
    name: sdos_AskAction
    title: AskAction
  sdos_AskPublicNewsArticle:
    class_uri: sdos:AskPublicNewsArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: A [[NewsArticle]] expressing an open call by a [[NewsMediaOrganization]]
      asking the public for input, insights, clarifications, anecdotes, documentation,
      etc., on an issue, for reporting purposes.
    is_a: sdos_NewsArticle
    name: sdos_AskPublicNewsArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: AskPublicNewsArticle
  sdos_AssessAction:
    class_uri: sdos:AssessAction
    description: The act of forming one's opinion, reaction or sentiment.
    is_a: sdos_Action
    name: sdos_AssessAction
    title: AssessAction
  sdos_AssignAction:
    class_uri: sdos:AssignAction
    description: The act of allocating an action/event/task to some destination (someone
      or something).
    is_a: sdos_AllocateAction
    name: sdos_AssignAction
    title: AssignAction
  sdos_Atlas:
    class_uri: sdos:Atlas
    description: A collection or bound volume of maps, charts, plates or tables, physical
      or in media form illustrating any subject.
    is_a: sdos_CreativeWork
    name: sdos_Atlas
    source: http://www.productontology.org/id/Atlas
    title: Atlas
  sdos_Attorney:
    class_uri: sdos:Attorney
    description: 'Professional service: Attorney. \n\nThis type is deprecated - [[LegalService]]
      is more inclusive and less ambiguous.'
    is_a: sdos_LegalService
    name: sdos_Attorney
    title: Attorney
  sdos_Audience:
    class_uri: sdos:Audience
    description: Intended audience for an item, i.e. the group for whom the item was
      created.
    is_a: sdos_Intangible
    name: sdos_Audience
    title: Audience
  sdos_AudioObject:
    class_uri: sdos:AudioObject
    contributors:
    - https://schema.org/docs/collab/rNews
    description: An audio file.
    is_a: sdos_MediaObject
    name: sdos_AudioObject
    title: AudioObject
  sdos_AudioObjectSnapshot:
    class_uri: sdos:AudioObjectSnapshot
    description: A specific and exact (byte-for-byte) version of an [[AudioObject]].
      Two byte-for-byte identical files, for the purposes of this type, considered
      identical. If they have different embedded metadata the files will differ. Different
      external facts about the files, e.g. creator or dateCreated that aren't represented
      in their actual content, do not affect this notion of identity.
    is_a: sdos_AudioObject
    name: sdos_AudioObjectSnapshot
    source: https://github.com/schemaorg/schemaorg/issues/2450
    title: AudioObjectSnapshot
  sdos_Audiobook:
    class_uri: sdos:Audiobook
    description: An audiobook.
    is_a: sdos_Book
    name: sdos_Audiobook
    title: Audiobook
  sdos_AuthorizeAction:
    class_uri: sdos:AuthorizeAction
    description: The act of granting permission to an object.
    is_a: sdos_AllocateAction
    name: sdos_AuthorizeAction
    title: AuthorizeAction
  sdos_AutoBodyShop:
    class_uri: sdos:AutoBodyShop
    description: Auto body shop.
    is_a: sdos_AutomotiveBusiness
    name: sdos_AutoBodyShop
    title: AutoBodyShop
  sdos_AutoDealer:
    class_uri: sdos:AutoDealer
    description: An car dealership.
    is_a: sdos_AutomotiveBusiness
    name: sdos_AutoDealer
    title: AutoDealer
  sdos_AutoPartsStore:
    class_uri: sdos:AutoPartsStore
    description: An auto parts store.
    is_a: sdos_Store
    name: sdos_AutoPartsStore
    title: AutoPartsStore
  sdos_AutoRental:
    class_uri: sdos:AutoRental
    description: A car rental business.
    is_a: sdos_AutomotiveBusiness
    name: sdos_AutoRental
    title: AutoRental
  sdos_AutoRepair:
    class_uri: sdos:AutoRepair
    description: Car repair business.
    is_a: sdos_AutomotiveBusiness
    name: sdos_AutoRepair
    title: AutoRepair
  sdos_AutoWash:
    class_uri: sdos:AutoWash
    description: A car wash business.
    is_a: sdos_AutomotiveBusiness
    name: sdos_AutoWash
    title: AutoWash
  sdos_AutomatedTeller:
    class_uri: sdos:AutomatedTeller
    description: ATM/cash machine.
    is_a: sdos_FinancialService
    name: sdos_AutomatedTeller
    title: AutomatedTeller
  sdos_AutomotiveBusiness:
    class_uri: sdos:AutomotiveBusiness
    description: Car repair, sales, or parts.
    is_a: sdos_LocalBusiness
    name: sdos_AutomotiveBusiness
    title: AutomotiveBusiness
  sdos_BackgroundNewsArticle:
    class_uri: sdos:BackgroundNewsArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: A [[NewsArticle]] providing historical context, definition and detail
      on a specific topic (aka "explainer" or "backgrounder"). For example, an in-depth
      article or frequently-asked-questions ([FAQ](https://en.wikipedia.org/wiki/FAQ))
      document on topics such as Climate Change or the European Union. Other kinds
      of background material from a non-news setting are often described using [[Book]]
      or [[Article]], in particular [[ScholarlyArticle]]. See also [[NewsArticle]]
      for related vocabulary from a learning/education perspective.
    is_a: sdos_NewsArticle
    name: sdos_BackgroundNewsArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: BackgroundNewsArticle
  sdos_Bakery:
    class_uri: sdos:Bakery
    description: A bakery.
    is_a: sdos_FoodEstablishment
    name: sdos_Bakery
    title: Bakery
  sdos_BankAccount:
    class_uri: sdos:BankAccount
    contributors:
    - https://schema.org/docs/collab/FIBO
    description: A product or service offered by a bank whereby one may deposit, withdraw
      or transfer money and in some cases be paid interest.
    is_a: sdos_FinancialProduct
    name: sdos_BankAccount
    title: BankAccount
  sdos_BankOrCreditUnion:
    class_uri: sdos:BankOrCreditUnion
    description: Bank or credit union.
    is_a: sdos_FinancialService
    name: sdos_BankOrCreditUnion
    title: BankOrCreditUnion
  sdos_BarOrPub:
    class_uri: sdos:BarOrPub
    description: A bar or pub.
    is_a: sdos_FoodEstablishment
    name: sdos_BarOrPub
    title: BarOrPub
  sdos_Barcode:
    class_uri: sdos:Barcode
    description: An image of a visual machine-readable code such as a barcode or QR
      code.
    is_a: sdos_ImageObject
    name: sdos_Barcode
    title: Barcode
  sdos_Beach:
    class_uri: sdos:Beach
    description: Beach.
    is_a: sdos_CivicStructure
    name: sdos_Beach
    title: Beach
  sdos_BeautySalon:
    class_uri: sdos:BeautySalon
    description: Beauty salon.
    is_a: sdos_HealthAndBeautyBusiness
    name: sdos_BeautySalon
    title: BeautySalon
  sdos_BedAndBreakfast:
    class_uri: sdos:BedAndBreakfast
    description: "Bed and breakfast.\u240A<br /><br />\u240ASee also the <a href=\"\
      /docs/hotels.html\">dedicated document on the use of schema.org for marking\
      \ up hotels and other forms of accommodations</a>."
    is_a: sdos_LodgingBusiness
    name: sdos_BedAndBreakfast
