  sdos_Campground:
    class_uri: sdos:Campground
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: "A camping site, campsite, or [[Campground]] is a place used for\
      \ overnight stay in the outdoors, typically containing individual [[CampingPitch]]\
      \ locations. \\n\\n\u240AIn British English a campsite is an area, usually divided\
      \ into a number of pitches, where people can camp overnight using tents or camper\
      \ vans or caravans; this British English use of the word is synonymous with\
      \ the American English expression campground. In American English the term campsite\
      \ generally means an area where an individual, family, group, or military unit\
      \ can pitch a tent or park a camper; a campground may contain many campsites\
      \ (source: Wikipedia, see [https://en.wikipedia.org/wiki/Campsite](https://en.wikipedia.org/wiki/Campsite)).\\\
      n\\n\u240A\u240ASee also the dedicated [document on the use of schema.org for\
      \ marking up hotels and other forms of accommodations](/docs/hotels.html)."
    is_a: sdos_LodgingBusiness
    name: sdos_Campground
    title: Campground
  sdos_CampingPitch:
    class_uri: sdos:CampingPitch
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: "A [[CampingPitch]] is an individual place for overnight stay in\
      \ the outdoors, typically being part of a larger camping site, or [[Campground]].\\\
      n\\n\u240AIn British English a campsite, or campground, is an area, usually\
      \ divided into a number of pitches, where people can camp overnight using tents\
      \ or camper vans or caravans; this British English use of the word is synonymous\
      \ with the American English expression campground. In American English the term\
      \ campsite generally means an area where an individual, family, group, or military\
      \ unit can pitch a tent or park a camper; a campground may contain many campsites.\u240A\
      (Source: Wikipedia, see [https://en.wikipedia.org/wiki/Campsite](https://en.wikipedia.org/wiki/Campsite).)\\\
      n\\n\u240ASee also the dedicated [document on the use of schema.org for marking\
      \ up hotels and other forms of accommodations](/docs/hotels.html)."
    is_a: sdos_Accommodation
    name: sdos_CampingPitch
    title: CampingPitch
