      an object's accuracy, quality, condition, or state.
    is_a: sdos_FindAction
    name: sdos_CheckAction
    title: CheckAction
  sdos_CheckInAction:
    class_uri: sdos:CheckInAction
    description: 'The act of an agent communicating (service provider, social media,
      etc) their arrival by registering/confirming for a previously reserved service
      (e.g. flight check-in) or at a place (e.g. hotel), possibly resulting in a result
      (boarding pass, etc).\n\nRelated actions:\n\n* [[CheckOutAction]]: The antonym
      of CheckInAction.\n* [[ArriveAction]]: Unlike ArriveAction, CheckInAction implies
      that the agent is informing/confirming the start of a previously reserved service.\n*
      [[ConfirmAction]]: Unlike ConfirmAction, CheckInAction implies that the agent
      is informing/confirming the *start* of a previously reserved service rather
      than its validity/existence.'
    is_a: sdos_CommunicateAction
    name: sdos_CheckInAction
    title: CheckInAction
  sdos_CheckOutAction:
    class_uri: sdos:CheckOutAction
    description: 'The act of an agent communicating (service provider, social media,
      etc) their departure of a previously reserved service (e.g. flight check-in)
      or place (e.g. hotel).\n\nRelated actions:\n\n* [[CheckInAction]]: The antonym
      of CheckOutAction.\n* [[DepartAction]]: Unlike DepartAction, CheckOutAction
      implies that the agent is informing/confirming the end of a previously reserved
      service.\n* [[CancelAction]]: Unlike CancelAction, CheckOutAction implies that
      the agent is informing/confirming the end of a previously reserved service.'
    is_a: sdos_CommunicateAction
    name: sdos_CheckOutAction
    title: CheckOutAction
