  sdos_Claim:
    class_uri: sdos:Claim
    description: "A [[Claim]] in Schema.org represents a specific, factually-oriented\
      \ claim that could be the [[itemReviewed]] in a [[ClaimReview]]. The content\
      \ of a claim can be summarized with the [[text]] property. Variations on well\
      \ known claims can have their common identity indicated via [[sameAs]] links,\
      \ and summarized with a [[name]]. Ideally, a [[Claim]] description includes\
      \ enough contextual information to minimize the risk of ambiguity or inclarity.\
      \ In practice, many claims are better understood in the context in which they\
      \ appear or the interpretations provided by claim reviews.\u240A\u240A  Beyond\
      \ [[ClaimReview]], the Claim type can be associated with related creative works\
      \ - for example a [[ScholarlyArticle]] or [[Question]] might be [[about]] some\
      \ [[Claim]].\u240A\u240A  At this time, Schema.org does not define any types\
      \ of relationship between claims. This is a natural area for future exploration."
    is_a: sdos_CreativeWork
    name: sdos_Claim
    source: https://github.com/schemaorg/schemaorg/issues/1828
    title: Claim
  sdos_ClaimReview:
    class_uri: sdos:ClaimReview
    description: A fact-checking review of claims made (or reported) in some creative
      work (referenced via itemReviewed).
    is_a: sdos_Review
    name: sdos_ClaimReview
    source: https://github.com/schemaorg/schemaorg/issues/1061
    title: ClaimReview
