  sdos_ComicIssue:
    class_uri: sdos:ComicIssue
    description: "Individual comic issues are serially published as\u240A    \tpart\
      \ of a larger series. For the sake of consistency, even one-shot issues\u240A\
      \    \tbelong to a series comprised of a single issue. All comic issues can\
      \ be\u240A    \tuniquely identified by: the combination of the name and volume\
      \ number of the\u240A    \tseries to which the issue belongs; the issue number;\
      \ and the variant\u240A    \tdescription of the issue (if any)."
    is_a: sdos_PublicationIssue
    name: sdos_ComicIssue
    title: ComicIssue
  sdos_ComicSeries:
    class_uri: sdos:ComicSeries
    description: "A sequential publication of comic stories under a\u240A    \tunifying\
      \ title, for example \"The Amazing Spider-Man\" or \"Groo the\u240A    \tWanderer\"\
      ."
    is_a: sdos_Periodical
    name: sdos_ComicSeries
    title: ComicSeries
  sdos_ComicStory:
    class_uri: sdos:ComicStory
    description: "The term \"story\" is any indivisible, re-printable\u240A    \t\
      unit of a comic, including the interior stories, covers, and backmatter. Most\u240A\
      \    \tcomics have at least two stories: a cover (ComicCoverArt) and an interior\
      \ story."
    is_a: sdos_CreativeWork
    name: sdos_ComicStory
    title: ComicStory
  sdos_Comment:
    class_uri: sdos:Comment
    description: A comment on an item - for example, a comment on a blog post. The
      comment's content is expressed via the [[text]] property, and its topic via
      [[about]], properties shared with all CreativeWorks.
    is_a: sdos_CreativeWork
    name: sdos_Comment
    title: Comment
  sdos_CommentAction:
    class_uri: sdos:CommentAction
    description: The act of generating a comment about a subject.
    is_a: sdos_CommunicateAction
    name: sdos_CommentAction
    title: CommentAction
  sdos_CommunicateAction:
    class_uri: sdos:CommunicateAction
    description: The act of conveying information to another person via a communication
      medium (instrument) such as speech, email, or telephone conversation.
    is_a: sdos_InteractAction
    name: sdos_CommunicateAction
    title: CommunicateAction
  sdos_CompleteDataFeed:
    class_uri: sdos:CompleteDataFeed
    description: "A [[CompleteDataFeed]] is a [[DataFeed]] whose standard representation\
      \ includes content for every item currently in the feed.\u240A\u240AThis is\
      \ the equivalent of Atom's element as defined in Feed Paging and Archiving [RFC\
      \ 5005](https://tools.ietf.org/html/rfc5005), for example (and as defined for\
      \ Atom), when using data from a feed that represents a collection of items that\
      \ varies over time (e.g. \"Top Twenty Records\") there is no need to have newer\
      \ entries mixed in alongside older, obsolete entries. By marking this feed as\
      \ a CompleteDataFeed, old entries can be safely discarded when the feed is refreshed,\
      \ since we can assume the feed has provided descriptions for all current items."
    is_a: sdos_DataFeed
    name: sdos_CompleteDataFeed
    source: https://github.com/schemaorg/schemaorg/issues/1397
    title: CompleteDataFeed
  sdos_CompoundPriceSpecification:
    class_uri: sdos:CompoundPriceSpecification
    contributors:
    - https://schema.org/docs/collab/GoodRelationsClass
    description: A compound price specification is one that bundles multiple prices
      that all apply in combination for different dimensions of consumption. Use the
      name property of the attached unit price specification for indicating the dimension
      of a price component (e.g. "electricity" or "final cleaning").
    is_a: sdos_PriceSpecification
    name: sdos_CompoundPriceSpecification
    title: CompoundPriceSpecification
  sdos_ComputerLanguage:
    class_uri: sdos:ComputerLanguage
    description: This type covers computer programming languages such as Scheme and
      Lisp, as well as other language-like computer representations. Natural languages
      are best represented with the [[Language]] type.
    is_a: sdos_Intangible
    name: sdos_ComputerLanguage
