    is_a: sdos_GovernmentBuilding
    name: sdos_Courthouse
    title: Courthouse
  sdos_CoverArt:
    class_uri: sdos:CoverArt
    description: The artwork on the outer surface of a CreativeWork.
    is_a: sdos_VisualArtwork
    name: sdos_CoverArt
    title: CoverArt
  sdos_CovidTestingFacility:
    class_uri: sdos:CovidTestingFacility
    description: "A CovidTestingFacility is a [[MedicalClinic]] where testing for\
      \ the COVID-19 Coronavirus\u240A      disease is available. If the facility\
      \ is being made available from an established [[Pharmacy]], [[Hotel]], or other\u240A\
      \      non-medical organization, multiple types can be listed. This makes it\
      \ easier to re-use existing schema.org information\u240A      about that place,\
      \ e.g. contact info, address, opening hours. Note that in an emergency, such\
      \ information may not always be reliable."
    is_a: sdos_MedicalClinic
    name: sdos_CovidTestingFacility
    source: https://github.com/schemaorg/schemaorg/issues/2490
