      photographs, software programs, etc.
    is_a: sdos_Thing
    name: sdos_CreativeWork
    title: CreativeWork
  sdos_CreativeWorkSeason:
    class_uri: sdos:CreativeWorkSeason
    description: A media season, e.g. TV, radio, video game etc.
    is_a: sdos_CreativeWork
