    title: CreativeWorkSeason
  sdos_CreativeWorkSeries:
    class_uri: sdos:CreativeWorkSeries
    description: A CreativeWorkSeries in schema.org is a group of related items, typically
      but not necessarily of the same kind. CreativeWorkSeries are usually organized
      into some order, often chronological. Unlike [[ItemList]] which is a general
      purpose data structure for lists of things, the emphasis with CreativeWorkSeries
      is on published materials (written e.g. books and periodicals, or media such
      as TV, radio and games).\n\nSpecific subtypes are available for describing [[TVSeries]],
      [[RadioSeries]], [[MovieSeries]], [[BookSeries]], [[Periodical]] and [[VideoGameSeries]].
      In each case, the [[hasPart]] / [[isPartOf]] properties can be used to relate
      the CreativeWorkSeries to its parts. The general CreativeWorkSeries type serves
      largely just to organize these more specific and practical subtypes.\n\nIt is
      common for properties applicable to an item from the series to be usefully applied
      to the containing group. Schema.org attempts to anticipate some of these cases,
      but publishers should be free to apply properties of the series parts to the
      series as a whole wherever they seem appropriate.
    is_a: sdos_Series
    name: sdos_CreativeWorkSeries
    title: CreativeWorkSeries
  sdos_CreditCard:
    class_uri: sdos:CreditCard
    contributors:
    - https://schema.org/docs/collab/FIBO
    - https://schema.org/docs/collab/GoodRelationsClass
    description: A card payment method of a particular brand or name.  Used to mark
      up a particular payment method and/or the financial product/service that supplies
      the card account.\n\nCommonly used values:\n\n* http://purl.org/goodrelations/v1#AmericanExpress\n*
      http://purl.org/goodrelations/v1#DinersClub\n* http://purl.org/goodrelations/v1#Discover\n*
      http://purl.org/goodrelations/v1#JCB\n* http://purl.org/goodrelations/v1#MasterCard\n*
      http://purl.org/goodrelations/v1#VISA
    is_a: sdos_PaymentCard
    name: sdos_CreditCard
    title: CreditCard
  sdos_Crematorium:
    class_uri: sdos:Crematorium
    description: A crematorium.
    is_a: sdos_CivicStructure
    name: sdos_Crematorium
    title: Crematorium
  sdos_CriticReview:
    class_uri: sdos:CriticReview
    description: A [[CriticReview]] is a more specialized form of Review written or
      published by a source that is recognized for its reviewing activities. These
      can include online columns, travel and food guides, TV and radio shows, blogs
      and other independent Web sites. [[CriticReview]]s are typically more in-depth
      and professionally written. For simpler, casually written user/visitor/viewer/customer
      reviews, it is more appropriate to use the [[UserReview]] type. Review aggregator
      sites such as Metacritic already separate out the site's user reviews from selected
      critic reviews that originate from third-party sources.
    is_a: sdos_Review
    name: sdos_CriticReview
    source: https://github.com/schemaorg/schemaorg/issues/1589
    title: CriticReview
  sdos_CssSelectorType:
    class_uri: sdos:CssSelectorType
    description: Text representing a CSS selector.
    is_a: sdos_Text
