    description: A body of structured information describing some topic(s) of interest.
    is_a: sdos_CreativeWork
    name: sdos_Dataset
    title: Dataset
  sdos_Date:
    class_uri: sdos:Date
    description: A date value in [ISO 8601 date format](http://en.wikipedia.org/wiki/ISO_8601).
