    title: DatedMoneySpecification
  sdos_DayOfWeek:
    class_uri: sdos:DayOfWeek
    contributors:
    - https://schema.org/docs/collab/GoodRelationsClass
    description: "The day of the week, e.g. used to specify to which day the opening\
      \ hours of an OpeningHoursSpecification refer.\u240A\u240AOriginally, URLs from\
      \ [GoodRelations](http://purl.org/goodrelations/v1) were used (for [[Monday]],\
      \ [[Tuesday]], [[Wednesday]], [[Thursday]], [[Friday]], [[Saturday]], [[Sunday]]\
      \ plus a special entry for [[PublicHolidays]]); these have now been integrated\
      \ directly into schema.org."
    is_a: sdos_Enumeration
    name: sdos_DayOfWeek
    slots:
    - sdos_contributor
    - rdfs_comment
    - sdos_sameAs
    - rdfs_label
    title: DayOfWeek
  sdos_DaySpa:
    class_uri: sdos:DaySpa
