  sdos_DefenceEstablishment:
    class_uri: sdos:DefenceEstablishment
    description: A defence establishment, such as an army or navy base.
    is_a: sdos_GovernmentBuilding
    name: sdos_DefenceEstablishment
    title: DefenceEstablishment
  sdos_DefinedRegion:
    class_uri: sdos:DefinedRegion
    description: "A DefinedRegion is a geographic area defined by potentially arbitrary\
      \ (rather than political, administrative or natural geographical) criteria.\
      \ Properties are provided for defining a region by reference to sets of postal\
      \ codes.\u240A\u240AExamples: a delivery destination when shopping. Region where\
      \ regional pricing is configured.\u240A\u240ARequirement 1:\u240ACountry: US\u240A\
      States: \"NY\", \"CA\"\u240A\u240ARequirement 2:\u240ACountry: US\u240APostalCode\
      \ Set: { [94000-94585], [97000, 97999], [13000, 13599]}\u240A{ [12345, 12345],\
      \ [78945, 78945], }\u240ARegion = state, canton, prefecture, autonomous community..."
    is_a: sdos_StructuredValue
    name: sdos_DefinedRegion
    source: https://github.com/schemaorg/schemaorg/issues/2506
    title: DefinedRegion
  sdos_DefinedTerm:
    class_uri: sdos:DefinedTerm
    description: A word, name, acronym, phrase, etc. with a formal definition. Often
      used in the context of category or subject classification, glossaries or dictionaries,
      product or creative work types, etc. Use the name property for the term being
      defined, use termCode if the term has an alpha-numeric code allocated, use description
      to provide the definition of the term.
    is_a: sdos_Intangible
    name: sdos_DefinedTerm
    source: https://github.com/schemaorg/schemaorg/issues/894
    title: DefinedTerm
  sdos_DefinedTermSet:
    class_uri: sdos:DefinedTermSet
