      scheme, a glossary, dictionary or enumeration.
    is_a: sdos_CreativeWork
    name: sdos_DefinedTermSet
    source: https://github.com/schemaorg/schemaorg/issues/894
    title: DefinedTermSet
  sdos_DeleteAction:
