    is_a: sdos_Event
    name: sdos_DeliveryEvent
    title: DeliveryEvent
  sdos_DeliveryMethod:
    class_uri: sdos:DeliveryMethod
    contributors:
    - https://schema.org/docs/collab/GoodRelationsClass
    description: A delivery method is a standardized procedure for transferring the
      product or service to the destination of fulfillment chosen by the customer.
      Delivery methods are characterized by the means of transportation used, and
      by the organization or group that is the contracting party for the sending organization
      or person.\n\nCommonly used values:\n\n* http://purl.org/goodrelations/v1#DeliveryModeDirectDownload\n*
      http://purl.org/goodrelations/v1#DeliveryModeFreight\n* http://purl.org/goodrelations/v1#DeliveryModeMail\n*
      http://purl.org/goodrelations/v1#DeliveryModeOwnFleet\n* http://purl.org/goodrelations/v1#DeliveryModePickUp\n*
