  sdos_EventSeries:
    class_uri: sdos:EventSeries
    description: "A series of [[Event]]s. Included events can relate with the series\
      \ using the [[superEvent]] property.\u240A\u240AAn EventSeries is a collection\
      \ of events that share some unifying characteristic. For example, \"The Olympic\
      \ Games\" is a series, which\u240Ais repeated regularly. The \"2012 London Olympics\"\
      \ can be presented both as an [[Event]] in the series \"Olympic Games\", and\
      \ as an\u240A[[EventSeries]] that included a number of sporting competitions\
      \ as Events.\u240A\u240AThe nature of the association between the events in\
      \ an [[EventSeries]] can vary, but typical examples could\u240Ainclude a thematic\
      \ event series (e.g. topical meetups or classes), or a series of regular events\
      \ that share a location, attendee group and/or organizers.\u240A\u240AEventSeries\
      \ has been defined as a kind of Event to make it easy for publishers to use\
      \ it in an Event context without\u240Aworrying about which kinds of series are\
      \ really event-like enough to call an Event. In general an EventSeries\u240A\
      may seem more Event-like when the period of time is compact and when aspects\
      \ such as location are fixed, but\u240Ait may also sometimes prove useful to\
      \ describe a longer-term series as an Event."
    is_a: sdos_Series
    name: sdos_EventSeries
    source: https://github.com/schemaorg/schemaorg/issues/447
    title: EventSeries
