      \ support, indicate [[sponsor]] of [[Grant]]s of resources (e.g. office space).\u240A\
      \u240AGrants support  activities directed towards some agreed collective goals,\
      \ often but not always organized as [[Project]]s. Long-lived projects are sometimes\
      \ sponsored by a variety of grants over time, but it is also common for a project\
      \ to be associated with a single grant.\u240A\u240AThe amount of a [[Grant]]\
      \ is represented using [[amount]] as a [[MonetaryAmount]]."
