    is_a: sdos_CreativeWork
    name: sdos_HowTo
    title: HowTo
  sdos_HowToDirection:
    class_uri: sdos:HowToDirection
    description: A direction indicating a single action to do in the instructions
      for how to achieve a result.
    is_a: sdos_ListItem
    name: sdos_HowToDirection
    title: HowToDirection
  sdos_HowToItem:
    class_uri: sdos:HowToItem
    description: An item used as either a tool or supply when performing the instructions
      for how to achieve a result.
    is_a: sdos_ListItem
    name: sdos_HowToItem
    title: HowToItem
  sdos_HowToSection:
    class_uri: sdos:HowToSection
    description: A sub-grouping of steps in the instructions for how to achieve a
      result (e.g. steps for making a pie crust within a pie recipe).
    is_a: sdos_ListItem
    name: sdos_HowToSection
    title: HowToSection
  sdos_HowToStep:
    class_uri: sdos:HowToStep
    description: A step in the instructions for how to achieve a result. It is an
      ordered list with HowToDirection and/or HowToTip items.
    is_a: sdos_ListItem
    name: sdos_HowToStep
    title: HowToStep
  sdos_HowToSupply:
    class_uri: sdos:HowToSupply
    description: A supply consumed when performing the instructions for how to achieve
      a result.
    is_a: sdos_HowToItem
    name: sdos_HowToSupply
    title: HowToSupply
  sdos_HowToTip:
    class_uri: sdos:HowToTip
    description: An explanation in the instructions for how to achieve a result. It
      provides supplementary information about a technique, supply, author's preference,
      etc. It can explain what could be done, or what should not be done, but doesn't
      specify what should be done (see HowToDirection).
    is_a: sdos_ListItem
    name: sdos_HowToTip
    title: HowToTip
  sdos_HowToTool:
    class_uri: sdos:HowToTool
    description: A tool used (but not consumed) when performing instructions for how
      to achieve a result.
    is_a: sdos_HowToItem
    name: sdos_HowToTool
    title: HowToTool
  sdos_HyperToc:
    class_uri: sdos:HyperToc
    description: A HyperToc represents a hypertext table of contents for complex media
      objects, such as [[VideoObject]], [[AudioObject]]. Items in the table of contents
      are indicated using the [[tocEntry]] property, and typed [[HyperTocEntry]].
      For cases where the same larger work is split into multiple files, [[associatedMedia]]
      can be used on individual [[HyperTocEntry]] items.
    is_a: sdos_CreativeWork
    name: sdos_HyperToc
    source: https://github.com/schemaorg/schemaorg/issues/2766
    title: HyperToc
  sdos_HyperTocEntry:
    class_uri: sdos:HyperTocEntry
    description: A HyperToEntry is an item within a [[HyperToc]], which represents
      a hypertext table of contents for complex media objects, such as [[VideoObject]],
      [[AudioObject]]. The media object itself is indicated using [[associatedMedia]].
      Each section of interest within that content can be described with a [[HyperTocEntry]],
      with associated [[startOffset]] and [[endOffset]]. When several entries are
      all from the same file, [[associatedMedia]] is used on the overarching [[HyperTocEntry]];
      if the content has been split into multiple files, they can be referenced using
      [[associatedMedia]] on each [[HyperTocEntry]].
    is_a: sdos_CreativeWork
    name: sdos_HyperTocEntry
    source: https://github.com/schemaorg/schemaorg/issues/2766
    title: HyperTocEntry
  sdos_IPTCDigitalSourceEnumeration:
    class_uri: sdos:IPTCDigitalSourceEnumeration
    description: "<a href=\"https://www.iptc.org/\">IPTC</a> \"Digital Source\" codes\
      \ for use with the [[digitalSourceType]] property, providing information about\
      \ the source for a digital media object.\u240AIn general these codes are not\
      \ declared here to be mutually exclusive, although some combinations would be\
      \ contradictory if applied simultaneously, or might be considered mutually incompatible\
      \ by upstream maintainers of the definitions. See the IPTC <a href=\"https://www.iptc.org/std/photometadata/documentation/userguide/\"\
      >documentation</a>\u240A for <a href=\"https://cv.iptc.org/newscodes/digitalsourcetype/\"\
      >detailed definitions</a> of all terms."
    is_a: sdos_MediaEnumeration
    name: sdos_IPTCDigitalSourceEnumeration
    slots:
    - skos_exactMatch
    - sdos_source
    - rdfs_comment
    - rdfs_label
    - sdos_isPartOf
    source: https://github.com/schemaorg/schemaorg/issues/3392
    title: IPTCDigitalSourceEnumeration
  sdos_IceCreamShop:
    class_uri: sdos:IceCreamShop
    description: An ice cream shop.
    is_a: sdos_FoodEstablishment
    name: sdos_IceCreamShop
    title: IceCreamShop
  sdos_IgnoreAction:
    class_uri: sdos:IgnoreAction
    description: The act of intentionally disregarding the object. An agent ignores
      an object.
    is_a: sdos_AssessAction
    name: sdos_IgnoreAction
    title: IgnoreAction
  sdos_ImageGallery:
    class_uri: sdos:ImageGallery
    description: 'Web page type: Image gallery page.'
    is_a: sdos_MediaGallery
    name: sdos_ImageGallery
    title: ImageGallery
  sdos_ImageObject:
    class_uri: sdos:ImageObject
    description: An image file.
    is_a: sdos_MediaObject
    name: sdos_ImageObject
    title: ImageObject
  sdos_ImageObjectSnapshot:
    class_uri: sdos:ImageObjectSnapshot
    description: A specific and exact (byte-for-byte) version of an [[ImageObject]].
      Two byte-for-byte identical files, for the purposes of this type, considered
      identical. If they have different embedded metadata (e.g. XMP, EXIF) the files
      will differ. Different external facts about the files, e.g. creator or dateCreated
      that aren't represented in their actual content, do not affect this notion of
      identity.
    is_a: sdos_ImageObject
    name: sdos_ImageObjectSnapshot
    source: https://github.com/schemaorg/schemaorg/issues/2450
    title: ImageObjectSnapshot
  sdos_ImagingTest:
    class_uri: sdos:ImagingTest
    description: Any medical imaging modality typically used for diagnostic purposes.
    is_a: sdos_MedicalTest
    name: sdos_ImagingTest
    title: ImagingTest
  sdos_IncentiveQualifiedExpenseType:
    class_uri: sdos:IncentiveQualifiedExpenseType
    description: The types of expenses that are covered by the incentive. For example
      some incentives are only for the goods (tangible items) but the services (labor)
      are excluded.
    is_a: sdos_Enumeration
    name: sdos_IncentiveQualifiedExpenseType
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/3572
    title: IncentiveQualifiedExpenseType
  sdos_IncentiveStatus:
    class_uri: sdos:IncentiveStatus
    description: Enumerates a status for an incentive, such as whether it is active.
    is_a: sdos_Enumeration
    name: sdos_IncentiveStatus
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/3572
    title: IncentiveStatus
  sdos_IncentiveType:
    class_uri: sdos:IncentiveType
    description: Enumerates common financial incentives for products, including tax
      credits, tax deductions, rebates and subsidies, etc.
    is_a: sdos_Enumeration
    name: sdos_IncentiveType
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/3572
    title: IncentiveType
  sdos_IndividualPhysician:
    class_uri: sdos:IndividualPhysician
    description: "An individual medical practitioner. For their official address use\
      \ [[address]], for affiliations to hospitals use [[hospitalAffiliation]]. \u240A\
      The [[practicesAt]] property can be used to indicate [[MedicalOrganization]]\
      \ hospitals, clinics, pharmacies etc. where this physician practices."
    is_a: sdos_Physician
    name: sdos_IndividualPhysician
    title: IndividualPhysician
  sdos_IndividualProduct:
    class_uri: sdos:IndividualProduct
    contributors:
    - https://schema.org/docs/collab/GoodRelationsClass
    description: A single, identifiable product instance (e.g. a laptop with a particular
      serial number).
    is_a: sdos_Product
    name: sdos_IndividualProduct
    title: IndividualProduct
  sdos_InfectiousAgentClass:
    class_uri: sdos:InfectiousAgentClass
    description: Classes of agents or pathogens that transmit infectious diseases.
      Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_InfectiousAgentClass
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: InfectiousAgentClass
  sdos_InfectiousDisease:
    class_uri: sdos:InfectiousDisease
    description: An infectious disease is a clinically evident human disease resulting
      from the presence of pathogenic microbial agents, like pathogenic viruses, pathogenic
      bacteria, fungi, protozoa, multicellular parasites, and prions. To be considered
      an infectious disease, such pathogens are known to be able to cause this disease.
    is_a: sdos_MedicalCondition
    name: sdos_InfectiousDisease
    title: InfectiousDisease
  sdos_InformAction:
    class_uri: sdos:InformAction
    description: The act of notifying someone of information pertinent to them, with
      no expectation of a response.
    is_a: sdos_CommunicateAction
    name: sdos_InformAction
    title: InformAction
  sdos_InsertAction:
    class_uri: sdos:InsertAction
