    is_a: sdos_AddAction
    name: sdos_InsertAction
    title: InsertAction
  sdos_InstallAction:
    class_uri: sdos:InstallAction
    description: The act of installing an application.
    is_a: sdos_ConsumeAction
    name: sdos_InstallAction
    title: InstallAction
  sdos_InsuranceAgency:
    class_uri: sdos:InsuranceAgency
    description: An Insurance agency.
    is_a: sdos_FinancialService
    name: sdos_InsuranceAgency
    title: InsuranceAgency
  sdos_Intangible:
    class_uri: sdos:Intangible
