    name: sdos_InteractAction
    title: InteractAction
  sdos_InteractionCounter:
    class_uri: sdos:InteractionCounter
    description: A summary of how users have interacted with this CreativeWork. In
      most cases, authors will use a subtype to specify the specific type of interaction.
    is_a: sdos_StructuredValue
    name: sdos_InteractionCounter
    title: InteractionCounter
  sdos_InternetCafe:
    class_uri: sdos:InternetCafe
    description: An internet cafe.
    is_a: sdos_LocalBusiness
    name: sdos_InternetCafe
    title: InternetCafe
  sdos_InvestmentFund:
    class_uri: sdos:InvestmentFund
    contributors:
    - https://schema.org/docs/collab/FIBO
    description: A company or fund that gathers capital from a number of investors
      to create a pool of money that is then re-invested into stocks, bonds and other
      assets.
    is_a: sdos_InvestmentOrDeposit
    name: sdos_InvestmentFund
    source: https://github.com/schemaorg/schemaorg/issues/1253
    title: InvestmentFund
  sdos_InvestmentOrDeposit:
    class_uri: sdos:InvestmentOrDeposit
    contributors:
    - https://schema.org/docs/collab/FIBO
    description: A type of financial product that typically requires the client to
      transfer funds to a financial service in return for potential beneficial financial
      return.
    is_a: sdos_FinancialProduct
    name: sdos_InvestmentOrDeposit
    title: InvestmentOrDeposit
  sdos_InviteAction:
    class_uri: sdos:InviteAction
    description: The act of asking someone to attend an event. Reciprocal of RsvpAction.
    is_a: sdos_CommunicateAction
    name: sdos_InviteAction
    title: InviteAction
  sdos_Invoice:
    class_uri: sdos:Invoice
    description: A statement of the money due for goods or services; a bill.
