    - rdfs_label
    title: ItemAvailability
  sdos_ItemList:
    class_uri: sdos:ItemList
    description: A list of items of any sort&#x2014;for example, Top 10 Movies About
      Weathermen, or Top 100 Party Songs. Not to be confused with HTML lists, which
      are often used only for formatting.
    is_a: sdos_Intangible
    name: sdos_ItemList
    title: ItemList
  sdos_ItemListOrderType:
    class_uri: sdos:ItemListOrderType
    description: Enumerated for values for itemListOrder for indicating how an ordered
      ItemList is organized.
    is_a: sdos_Enumeration
    name: sdos_ItemListOrderType
    slots:
    - rdfs_comment
    - rdfs_label
    title: ItemListOrderType
  sdos_ItemPage:
    class_uri: sdos:ItemPage
    description: A page devoted to a single item, such as a particular product or
      hotel.
    is_a: sdos_WebPage
    name: sdos_ItemPage
    title: ItemPage
  sdos_JewelryStore:
    class_uri: sdos:JewelryStore
    description: A jewelry store.
    is_a: sdos_Store
