  sdos_JoinAction:
    class_uri: sdos:JoinAction
    description: 'An agent joins an event/group with participants/friends at a location.\n\nRelated
      actions:\n\n* [[RegisterAction]]: Unlike RegisterAction, JoinAction refers to
      joining a group/team of people.\n* [[SubscribeAction]]: Unlike SubscribeAction,
      JoinAction does not imply that you''ll be receiving updates.\n* [[FollowAction]]:
      Unlike FollowAction, JoinAction does not imply that you''ll be polling for updates.'
    is_a: sdos_InteractAction
    name: sdos_JoinAction
    title: JoinAction
  sdos_Joint:
    class_uri: sdos:Joint
    description: The anatomical location at which two or more bones make contact.
    is_a: sdos_AnatomicalStructure
    name: sdos_Joint
    title: Joint
  sdos_LakeBodyOfWater:
    class_uri: sdos:LakeBodyOfWater
    description: A lake (for example, Lake Pontrachain).
    is_a: sdos_BodyOfWater
    name: sdos_LakeBodyOfWater
    title: LakeBodyOfWater
  sdos_Landform:
    class_uri: sdos:Landform
    description: A landform or physical feature.  Landform elements include mountains,
      plains, lakes, rivers, seascape and oceanic waterbody interface features such
      as bays, peninsulas, seas and so forth, including sub-aqueous terrain features
      such as submersed mountain ranges, volcanoes, and the great ocean basins.
    is_a: sdos_Place
    name: sdos_Landform
    title: Landform
  sdos_LandmarksOrHistoricalBuildings:
    class_uri: sdos:LandmarksOrHistoricalBuildings
    description: An historical landmark or building.
    is_a: sdos_Place
    name: sdos_LandmarksOrHistoricalBuildings
    title: LandmarksOrHistoricalBuildings
  sdos_Language:
    class_uri: sdos:Language
    description: Natural languages such as Spanish, Tamil, Hindi, English, etc. Formal
      language code tags expressed in [BCP 47](https://en.wikipedia.org/wiki/IETF_language_tag)
      can be used via the [[alternateName]] property. The Language type previously
      also covered programming languages such as Scheme and Lisp, which are now best
      represented using [[ComputerLanguage]].
    is_a: sdos_Intangible
    name: sdos_Language
    title: Language
  sdos_LearningResource:
    class_uri: sdos:LearningResource
    description: "The LearningResource type can be used to indicate [[CreativeWork]]s\
      \ (whether physical or digital) that have a particular and explicit orientation\
      \ towards learning, education, skill acquisition, and other educational purposes.\u240A\
      \u240A[[LearningResource]] is expected to be used as an addition to a primary\
      \ type such as [[Book]], [[VideoObject]], [[Product]] etc.\u240A\u240A[[EducationEvent]]\
      \ serves a similar purpose for event-like things (e.g. a [[Trip]]). A [[LearningResource]]\
      \ may be created as a result of an [[EducationEvent]], for example by recording\
      \ one."
    is_a: sdos_CreativeWork
    name: sdos_LearningResource
    source: https://github.com/schemaorg/schemaorg/issues/1401
    title: LearningResource
  sdos_LeaveAction:
    class_uri: sdos:LeaveAction
    description: 'An agent leaves an event / group with participants/friends at a
      location.\n\nRelated actions:\n\n* [[JoinAction]]: The antonym of LeaveAction.\n*
      [[UnRegisterAction]]: Unlike UnRegisterAction, LeaveAction implies leaving a
      group/team of people rather than a service.'
    is_a: sdos_InteractAction
    name: sdos_LeaveAction
    title: LeaveAction
