  sdos_Ligament:
    class_uri: sdos:Ligament
    description: A short band of tough, flexible, fibrous connective tissue that functions
      to connect multiple bones, cartilages, and structurally support joints.
    is_a: sdos_AnatomicalStructure
    name: sdos_Ligament
    title: Ligament
  sdos_LikeAction:
