    class_uri: sdos:Locksmith
    description: A locksmith.
    is_a: sdos_HomeAndConstructionBusiness
    name: sdos_Locksmith
    title: Locksmith
  sdos_LodgingBusiness:
    class_uri: sdos:LodgingBusiness
    description: A lodging business, such as a motel, hotel, or inn.
    is_a: sdos_LocalBusiness
    name: sdos_LodgingBusiness
    title: LodgingBusiness
  sdos_LodgingReservation:
    class_uri: sdos:LodgingReservation
    description: 'A reservation for lodging at a hotel, motel, inn, etc.\n\nNote:
      This type is for information about actual reservations, e.g. in confirmation
      emails or HTML pages with individual confirmations of reservations.'
    is_a: sdos_Reservation
    name: sdos_LodgingReservation
    title: LodgingReservation
  sdos_LoseAction:
    class_uri: sdos:LoseAction
    description: The act of being defeated in a competitive activity.
    is_a: sdos_AchieveAction
    name: sdos_LoseAction
    title: LoseAction
  sdos_LymphaticVessel:
    class_uri: sdos:LymphaticVessel
    description: A type of blood vessel that specifically carries lymph fluid unidirectionally
      toward the heart.
    is_a: sdos_Vessel
    name: sdos_LymphaticVessel
    title: LymphaticVessel
  sdos_Manuscript:
    class_uri: sdos:Manuscript
    description: A book, document, or piece of music written by hand rather than typed
      or printed.
    is_a: sdos_CreativeWork
    name: sdos_Manuscript
    source: https://github.com/schemaorg/schemaorg/issues/1448
    title: Manuscript
  sdos_Map:
    class_uri: sdos:Map
    description: A map.
    is_a: sdos_CreativeWork
    name: sdos_Map
    title: Map
  sdos_MapCategoryType:
    class_uri: sdos:MapCategoryType
    description: An enumeration of several kinds of Map.
    is_a: sdos_Enumeration
    name: sdos_MapCategoryType
    slots:
    - rdfs_comment
    - rdfs_label
    title: MapCategoryType
  sdos_MarryAction:
    class_uri: sdos:MarryAction
    description: The act of marrying a person.
    is_a: sdos_InteractAction
    name: sdos_MarryAction
    title: MarryAction
  sdos_Mass:
    class_uri: sdos:Mass
    description: Properties that take Mass as values are of the form '&lt;Number&gt;
      &lt;Mass unit of measure&gt;'. E.g., '7 kg'.
    is_a: sdos_Quantity
    name: sdos_Mass
    title: Mass
  sdos_MathSolver:
    class_uri: sdos:MathSolver
    description: A math solver which is capable of solving a subset of mathematical
      problems.
    is_a: sdos_CreativeWork
    name: sdos_MathSolver
    source: https://github.com/schemaorg/schemaorg/issues/2740
    title: MathSolver
  sdos_MaximumDoseSchedule:
    class_uri: sdos:MaximumDoseSchedule
    description: The maximum dosing schedule considered safe for a drug or supplement
      as recommended by an authority or by the drug/supplement's manufacturer. Capture
      the recommending authority in the recognizingAuthority property of MedicalEntity.
    is_a: sdos_DoseSchedule
    name: sdos_MaximumDoseSchedule
    title: MaximumDoseSchedule
  sdos_MeasurementMethodEnum:
    class_uri: sdos:MeasurementMethodEnum
    description: Enumeration(s) for use with [[measurementMethod]].
    is_a: sdos_Enumeration
    name: sdos_MeasurementMethodEnum
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2564
    title: MeasurementMethodEnum
  sdos_MeasurementTypeEnumeration:
    class_uri: sdos:MeasurementTypeEnumeration
    description: Enumeration of common measurement types (or dimensions), for example
      "chest" for a person, "inseam" for pants, "gauge" for screws, or "wheel" for
      bicycles.
    is_a: sdos_Enumeration
    name: sdos_MeasurementTypeEnumeration
    source: https://github.com/schemaorg/schemaorg/issues/2811
    title: MeasurementTypeEnumeration
  sdos_MediaEnumeration:
    class_uri: sdos:MediaEnumeration
    description: MediaEnumeration enumerations are lists of codes, labels etc. useful
      for describing media objects. They may be reflections of externally developed
      lists, or created at schema.org, or a combination.
    is_a: sdos_Enumeration
    name: sdos_MediaEnumeration
    source: https://github.com/schemaorg/schemaorg/issues/3392
    title: MediaEnumeration
  sdos_MediaGallery:
    class_uri: sdos:MediaGallery
    description: 'Web page type: Media gallery page. A mixed-media page that can contain
      media such as images, videos, and other multimedia.'
    is_a: sdos_CollectionPage
    name: sdos_MediaGallery
    title: MediaGallery
  sdos_MediaManipulationRatingEnumeration:
    class_uri: sdos:MediaManipulationRatingEnumeration
    description: Codes for use with the [[mediaAuthenticityCategory]] property, indicating
      the authenticity of a media object (in the context of how it was published or
      shared). In general these codes are not mutually exclusive, although some combinations
      (such as 'original' versus 'transformed', 'edited' and 'staged') would be contradictory
      if applied in the same [[MediaReview]]. Note that the application of these codes
      is with regard to a piece of media shared or published in a particular context.
    is_a: sdos_Enumeration
    name: sdos_MediaManipulationRatingEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2450
    title: MediaManipulationRatingEnumeration
  sdos_MediaObject:
    class_uri: sdos:MediaObject
    description: A media object, such as an image, video, audio, or text object embedded
      in a web page or a downloadable dataset i.e. DataDownload. Note that a creative
      work may have many media objects associated with it on the same web page. For
      example, a page about a single song (MusicRecording) may have a music video
      (VideoObject), and a high and low bandwidth audio stream (2 AudioObject's).
    is_a: sdos_CreativeWork
    name: sdos_MediaObject
    title: MediaObject
  sdos_MediaReview:
    class_uri: sdos:MediaReview
    description: "A [[MediaReview]] is a more specialized form of Review dedicated\
      \ to the evaluation of media content online, typically in the context of fact-checking\
      \ and misinformation.\u240A    For more general reviews of media in the broader\
      \ sense, use [[UserReview]], [[CriticReview]] or other [[Review]] types. This\
      \ definition is\u240A    a work in progress. While the [[MediaManipulationRatingEnumeration]]\
      \ list reflects significant community review amongst fact-checkers and others\
      \ working\u240A    to combat misinformation, the specific structures for representing\
      \ media objects, their versions and publication context, are still evolving.\
      \ Similarly, best practices for the relationship between [[MediaReview]] and\
      \ [[ClaimReview]] markup have not yet been finalized."
    is_a: sdos_Review
    name: sdos_MediaReview
    source: https://github.com/schemaorg/schemaorg/issues/2450
    title: MediaReview
  sdos_MediaReviewItem:
    class_uri: sdos:MediaReviewItem
    description: Represents an item or group of closely related items treated as a
      unit for the sake of evaluation in a [[MediaReview]]. Authorship etc. apply
      to the items rather than to the curation/grouping or reviewing party.
    is_a: sdos_CreativeWork
    name: sdos_MediaReviewItem
    source: https://github.com/schemaorg/schemaorg/issues/2450
    title: MediaReviewItem
  sdos_MediaSubscription:
    class_uri: sdos:MediaSubscription
    description: A subscription which allows a user to access media including audio,
      video, books, etc.
    is_a: sdos_Intangible
    name: sdos_MediaSubscription
    source: https://github.com/schemaorg/schemaorg/issues/1741
    title: MediaSubscription
  sdos_MedicalAudience:
    class_uri: sdos:MedicalAudience
    description: Target audiences for medical web pages.
    is_a: sdos_PeopleAudience
    name: sdos_MedicalAudience
    title: MedicalAudience
  sdos_MedicalAudienceType:
    class_uri: sdos:MedicalAudienceType
    description: Target audiences types for medical web pages. Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalAudienceType
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalAudienceType
  sdos_MedicalBusiness:
    class_uri: sdos:MedicalBusiness
    description: A particular physical or virtual business of an organization for
      medical purposes. Examples of MedicalBusiness include different businesses run
      by health professionals.
    is_a: sdos_LocalBusiness
    name: sdos_MedicalBusiness
    title: MedicalBusiness
  sdos_MedicalCause:
    class_uri: sdos:MedicalCause
    description: The causative agent(s) that are responsible for the pathophysiologic
      process that eventually results in a medical condition, symptom or sign. In
      this schema, unless otherwise specified this is meant to be the proximate cause
      of the medical condition, symptom or sign. The proximate cause is defined as
      the causative agent that most directly results in the medical condition, symptom
      or sign. For example, the HIV virus could be considered a cause of AIDS. Or
      in a diagnostic context, if a patient fell and sustained a hip fracture and
      two days later sustained a pulmonary embolism which eventuated in a cardiac
      arrest, the cause of the cardiac arrest (the proximate cause) would be the pulmonary
      embolism and not the fall. Medical causes can include cardiovascular, chemical,
      dermatologic, endocrine, environmental, gastroenterologic, genetic, hematologic,
      gynecologic, iatrogenic, infectious, musculoskeletal, neurologic, nutritional,
      obstetric, oncologic, otolaryngologic, pharmacologic, psychiatric, pulmonary,
      renal, rheumatologic, toxic, traumatic, or urologic causes; medical conditions
      can be causes as well.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalCause
    title: MedicalCause
  sdos_MedicalClinic:
    class_uri: sdos:MedicalClinic
    description: A facility, often associated with a hospital or medical school, that
      is devoted to the specific diagnosis and/or healthcare. Previously limited to
      outpatients but with evolution it may be open to inpatients as well.
    is_a: sdos_MedicalOrganization
    name: sdos_MedicalClinic
    title: MedicalClinic
  sdos_MedicalCode:
    class_uri: sdos:MedicalCode
    description: A code for a medical entity.
    is_a: sdos_MedicalIntangible
    name: sdos_MedicalCode
    title: MedicalCode
  sdos_MedicalCondition:
    class_uri: sdos:MedicalCondition
    description: Any condition of the human body that affects the normal functioning
      of a person, whether physically or mentally. Includes diseases, injuries, disabilities,
      disorders, syndromes, etc.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalCondition
    title: MedicalCondition
  sdos_MedicalConditionStage:
    class_uri: sdos:MedicalConditionStage
    description: A stage of a medical condition, such as 'Stage IIIa'.
    is_a: sdos_MedicalIntangible
    name: sdos_MedicalConditionStage
    title: MedicalConditionStage
  sdos_MedicalContraindication:
    class_uri: sdos:MedicalContraindication
    description: A condition or factor that serves as a reason to withhold a certain
      medical therapy. Contraindications can be absolute (there are no reasonable
      circumstances for undertaking a course of action) or relative (the patient is
      at higher risk of complications, but these risks may be outweighed by other
      considerations or mitigated by other measures).
    is_a: sdos_MedicalEntity
    name: sdos_MedicalContraindication
    title: MedicalContraindication
  sdos_MedicalDevice:
    class_uri: sdos:MedicalDevice
    description: Any object used in a medical capacity, such as to diagnose or treat
      a patient.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalDevice
    title: MedicalDevice
  sdos_MedicalDevicePurpose:
    class_uri: sdos:MedicalDevicePurpose
    description: Categories of medical devices, organized by the purpose or intended
      use of the device.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalDevicePurpose
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalDevicePurpose
  sdos_MedicalEntity:
    class_uri: sdos:MedicalEntity
    description: The most generic type of entity related to health and the practice
      of medicine.
    is_a: sdos_Thing
    name: sdos_MedicalEntity
    title: MedicalEntity
  sdos_MedicalEnumeration:
    class_uri: sdos:MedicalEnumeration
    description: 'Enumerations related to health and the practice of medicine: A concept
      that is used to attribute a quality to another concept, as a qualifier, a collection
      of items or a listing of all of the elements of a set in medicine practice.'
    is_a: sdos_Enumeration
    name: sdos_MedicalEnumeration
    title: MedicalEnumeration
  sdos_MedicalEvidenceLevel:
    class_uri: sdos:MedicalEvidenceLevel
    description: Level of evidence for a medical guideline. Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalEvidenceLevel
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalEvidenceLevel
  sdos_MedicalGuideline:
    class_uri: sdos:MedicalGuideline
    description: 'Any recommendation made by a standard society (e.g. ACC/AHA) or
      consensus statement that denotes how to diagnose and treat a particular condition.
      Note: this type should be used to tag the actual guideline recommendation; if
      the guideline recommendation occurs in a larger scholarly article, use MedicalScholarlyArticle
      to tag the overall article, not this type. Note also: the organization making
      the recommendation should be captured in the recognizingAuthority base property
      of MedicalEntity.'
    is_a: sdos_MedicalEntity
    name: sdos_MedicalGuideline
    title: MedicalGuideline
  sdos_MedicalGuidelineContraindication:
    class_uri: sdos:MedicalGuidelineContraindication
    description: A guideline contraindication that designates a process as harmful
      and where quality of the data supporting the contraindication is sound.
    is_a: sdos_MedicalGuideline
    name: sdos_MedicalGuidelineContraindication
    title: MedicalGuidelineContraindication
  sdos_MedicalGuidelineRecommendation:
    class_uri: sdos:MedicalGuidelineRecommendation
    description: A guideline recommendation that is regarded as efficacious and where
      quality of the data supporting the recommendation is sound.
    is_a: sdos_MedicalGuideline
    name: sdos_MedicalGuidelineRecommendation
    title: MedicalGuidelineRecommendation
  sdos_MedicalImagingTechnique:
    class_uri: sdos:MedicalImagingTechnique
    description: Any medical imaging modality typically used for diagnostic purposes.
      Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalImagingTechnique
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalImagingTechnique
  sdos_MedicalIndication:
    class_uri: sdos:MedicalIndication
    description: A condition or factor that indicates use of a medical therapy, including
      signs, symptoms, risk factors, anatomical states, etc.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalIndication
    title: MedicalIndication
  sdos_MedicalIntangible:
    class_uri: sdos:MedicalIntangible
    description: A utility class that serves as the umbrella for a number of 'intangible'
      things in the medical space.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalIntangible
    title: MedicalIntangible
  sdos_MedicalObservationalStudy:
    class_uri: sdos:MedicalObservationalStudy
    description: An observational study is a type of medical study that attempts to
      infer the possible effect of a treatment through observation of a cohort of
      subjects over a period of time. In an observational study, the assignment of
      subjects into treatment groups versus control groups is outside the control
      of the investigator. This is in contrast with controlled studies, such as the
      randomized controlled trials represented by MedicalTrial, where each subject
      is randomly assigned to a treatment group or a control group before the start
      of the treatment.
    is_a: sdos_MedicalStudy
    name: sdos_MedicalObservationalStudy
    title: MedicalObservationalStudy
  sdos_MedicalObservationalStudyDesign:
    class_uri: sdos:MedicalObservationalStudyDesign
    description: Design models for observational medical studies. Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalObservationalStudyDesign
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalObservationalStudyDesign
  sdos_MedicalOrganization:
    class_uri: sdos:MedicalOrganization
    description: A medical organization (physical or not), such as hospital, institution
      or clinic.
    is_a: sdos_Organization
    name: sdos_MedicalOrganization
    title: MedicalOrganization
  sdos_MedicalProcedure:
    class_uri: sdos:MedicalProcedure
    description: A process of care used in either a diagnostic, therapeutic, preventive
      or palliative capacity that relies on invasive (surgical), non-invasive, or
      other techniques.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalProcedure
    title: MedicalProcedure
  sdos_MedicalProcedureType:
    class_uri: sdos:MedicalProcedureType
    description: An enumeration that describes different types of medical procedures.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalProcedureType
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalProcedureType
  sdos_MedicalRiskCalculator:
    class_uri: sdos:MedicalRiskCalculator
    description: 'A complex mathematical calculation requiring an online calculator,
      used to assess prognosis. Note: use the url property of Thing to record any
      URLs for online calculators.'
    is_a: sdos_MedicalRiskEstimator
    name: sdos_MedicalRiskCalculator
    title: MedicalRiskCalculator
  sdos_MedicalRiskEstimator:
    class_uri: sdos:MedicalRiskEstimator
    description: Any rule set or interactive tool for estimating the risk of developing
      a complication or condition.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalRiskEstimator
    title: MedicalRiskEstimator
  sdos_MedicalRiskFactor:
    class_uri: sdos:MedicalRiskFactor
    description: A risk factor is anything that increases a person's likelihood of
      developing or contracting a disease, medical condition, or complication.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalRiskFactor
    title: MedicalRiskFactor
  sdos_MedicalRiskScore:
    class_uri: sdos:MedicalRiskScore
    description: A simple system that adds up the number of risk factors to yield
      a score that is associated with prognosis, e.g. CHAD score, TIMI risk score.
    is_a: sdos_MedicalRiskEstimator
    name: sdos_MedicalRiskScore
    title: MedicalRiskScore
  sdos_MedicalScholarlyArticle:
    class_uri: sdos:MedicalScholarlyArticle
    description: A scholarly article in the medical domain.
    is_a: sdos_ScholarlyArticle
    name: sdos_MedicalScholarlyArticle
    title: MedicalScholarlyArticle
  sdos_MedicalSign:
    class_uri: sdos:MedicalSign
    description: Any physical manifestation of a person's medical condition discoverable
      by objective diagnostic tests or physical examination.
    is_a: sdos_MedicalSignOrSymptom
    name: sdos_MedicalSign
    title: MedicalSign
  sdos_MedicalSignOrSymptom:
    class_uri: sdos:MedicalSignOrSymptom
    description: Any feature associated or not with a medical condition. In medicine
      a symptom is generally subjective while a sign is objective.
    is_a: sdos_MedicalCondition
    name: sdos_MedicalSignOrSymptom
    title: MedicalSignOrSymptom
  sdos_MedicalSpecialty:
    class_uri: sdos:MedicalSpecialty
    description: Any specific branch of medical science or practice. Medical specialities
      include clinical specialties that pertain to particular organ systems and their
      respective disease states, as well as allied health specialties. Enumerated
      type.
    is_a: sdos_Specialty
    name: sdos_MedicalSpecialty
    slots:
    - sdos_supersededBy
    - rdfs_subClassOf
    - rdfs_comment
    - rdfs_label
    - sdos_isPartOf
    title: MedicalSpecialty
  sdos_MedicalStudy:
    class_uri: sdos:MedicalStudy
    description: 'A medical study is an umbrella type covering all kinds of research
      studies relating to human medicine or health, including observational studies
      and interventional trials and registries, randomized, controlled or not. When
      the specific type of study is known, use one of the extensions of this type,
      such as MedicalTrial or MedicalObservationalStudy. Also, note that this type
      should be used to mark up data that describes the study itself; to tag an article
      that publishes the results of a study, use MedicalScholarlyArticle. Note: use
      the code property of MedicalEntity to store study IDs, e.g. clinicaltrials.gov
      ID.'
    is_a: sdos_MedicalEntity
    name: sdos_MedicalStudy
    title: MedicalStudy
  sdos_MedicalStudyStatus:
    class_uri: sdos:MedicalStudyStatus
    description: The status of a medical study. Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalStudyStatus
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalStudyStatus
  sdos_MedicalSymptom:
    class_uri: sdos:MedicalSymptom
    description: Any complaint sensed and expressed by the patient (therefore defined
      as subjective)  like stomachache, lower-back pain, or fatigue.
    is_a: sdos_MedicalSignOrSymptom
    name: sdos_MedicalSymptom
    title: MedicalSymptom
  sdos_MedicalTest:
    class_uri: sdos:MedicalTest
    description: Any medical test, typically performed for diagnostic purposes.
    is_a: sdos_MedicalEntity
    name: sdos_MedicalTest
    title: MedicalTest
  sdos_MedicalTestPanel:
    class_uri: sdos:MedicalTestPanel
    description: Any collection of tests commonly ordered together.
    is_a: sdos_MedicalTest
    name: sdos_MedicalTestPanel
    title: MedicalTestPanel
  sdos_MedicalTherapy:
    class_uri: sdos:MedicalTherapy
    description: Any medical intervention designed to prevent, treat, and cure human
      diseases and medical conditions, including both curative and palliative therapies.
      Medical therapies are typically processes of care relying upon pharmacotherapy,
      behavioral therapy, supportive therapy (with fluid or nutrition for example),
      or detoxification (e.g. hemodialysis) aimed at improving or preventing a health
      condition.
    is_a: sdos_TherapeuticProcedure
    name: sdos_MedicalTherapy
    title: MedicalTherapy
  sdos_MedicalTrial:
    class_uri: sdos:MedicalTrial
    description: A medical trial is a type of medical study that uses a scientific
      process to compare the safety and efficacy of medical therapies or medical procedures.
      In general, medical trials are controlled and subjects are allocated at random
      to the different treatment and/or control groups.
    is_a: sdos_MedicalStudy
    name: sdos_MedicalTrial
    title: MedicalTrial
  sdos_MedicalTrialDesign:
    class_uri: sdos:MedicalTrialDesign
    contributors:
    - https://schema.org/docs/collab/WikiDoc
    description: Design models for medical trials. Enumerated type.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicalTrialDesign
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicalTrialDesign
  sdos_MedicalWebPage:
    class_uri: sdos:MedicalWebPage
    description: A web page that provides medical information.
    is_a: sdos_WebPage
    name: sdos_MedicalWebPage
    title: MedicalWebPage
  sdos_MedicineSystem:
    class_uri: sdos:MedicineSystem
    description: Systems of medical practice.
    is_a: sdos_MedicalEnumeration
    name: sdos_MedicineSystem
    slots:
    - rdfs_comment
    - sdos_isPartOf
    - rdfs_label
    title: MedicineSystem
  sdos_MeetingRoom:
    class_uri: sdos:MeetingRoom
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: "A meeting room, conference room, or conference hall is a room provided\
      \ for singular events such as business conferences and meetings (source: Wikipedia,\
      \ the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Conference_hall\"\
      >http://en.wikipedia.org/wiki/Conference_hall</a>).\u240A<br /><br />\u240A\
      See also the <a href=\"/docs/hotels.html\">dedicated document on the use of\
      \ schema.org for marking up hotels and other forms of accommodations</a>."
    is_a: sdos_Room
    name: sdos_MeetingRoom
    title: MeetingRoom
  sdos_MemberProgram:
    class_uri: sdos:MemberProgram
    description: A MemberProgram defines a loyalty (or membership) program that provides
      its members with certain benefits, for example better pricing, free shipping
      or returns, or the ability to earn loyalty points. Member programs may have
      multiple tiers, for example silver and gold members, each with different benefits.
    is_a: sdos_Intangible
    name: sdos_MemberProgram
    source: https://github.com/schemaorg/schemaorg/issues/3563
    title: MemberProgram
  sdos_MemberProgramTier:
    class_uri: sdos:MemberProgramTier
    description: A MemberProgramTier specifies a tier under a loyalty (member) program,
      for example "gold".
    is_a: sdos_Intangible
    name: sdos_MemberProgramTier
    source: https://github.com/schemaorg/schemaorg/issues/3563
    title: MemberProgramTier
  sdos_MensClothingStore:
    class_uri: sdos:MensClothingStore
    description: A men's clothing store.
    is_a: sdos_Store
    name: sdos_MensClothingStore
    title: MensClothingStore
  sdos_Menu:
    class_uri: sdos:Menu
    description: A structured representation of food or drink items available from
      a FoodEstablishment.
    is_a: sdos_CreativeWork
    name: sdos_Menu
    title: Menu
  sdos_MenuItem:
    class_uri: sdos:MenuItem
    description: A food or drink item listed in a menu or menu section.
    is_a: sdos_Intangible
    name: sdos_MenuItem
    title: MenuItem
  sdos_MenuSection:
    class_uri: sdos:MenuSection
    description: A sub-grouping of food or drink items in a menu. E.g. courses (such
      as 'Dinner', 'Breakfast', etc.), specific type of dishes (such as 'Meat', 'Vegan',
      'Drinks', etc.), or some other classification made by the menu provider.
    is_a: sdos_CreativeWork
    name: sdos_MenuSection
    title: MenuSection
  sdos_MerchantReturnEnumeration:
    class_uri: sdos:MerchantReturnEnumeration
    description: Enumerates several kinds of product return policies.
    is_a: sdos_Enumeration
    name: sdos_MerchantReturnEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2288
    title: MerchantReturnEnumeration
  sdos_MerchantReturnPolicy:
    class_uri: sdos:MerchantReturnPolicy
    description: A MerchantReturnPolicy provides information about product return
      policies associated with an [[Organization]], [[Product]], or [[Offer]].
    is_a: sdos_Intangible
    name: sdos_MerchantReturnPolicy
    source: https://github.com/schemaorg/schemaorg/issues/2288
