      \ and technical structures used, and by the organization or group carrying out\
      \ the transaction. The following legacy values should be accepted:\u240A   \
      \ \\n\\n* http://purl.org/goodrelations/v1#ByBankTransferInAdvance\\n* http://purl.org/goodrelations/v1#ByInvoice\\\
      n* http://purl.org/goodrelations/v1#Cash\\n* http://purl.org/goodrelations/v1#CheckInAdvance\\\
      n* http://purl.org/goodrelations/v1#COD\\n* http://purl.org/goodrelations/v1#DirectDebit\\\
      n* http://purl.org/goodrelations/v1#GoogleCheckout\\n* http://purl.org/goodrelations/v1#PayPal\\\
      n* http://purl.org/goodrelations/v1#PaySwarm\\n\\nStructured values are recommended\
      \ for newer payment methods."
