      nThe general [[ProfessionalService]] type for local businesses was deprecated\
      \ due to confusion with [[Service]]. For reference, the types that it included\
      \ were: [[Dentist]],\u240A        [[AccountingService]], [[Attorney]], [[Notary]],\
      \ as well as types for several kinds of [[HomeAndConstructionBusiness]]: [[Electrician]],\
      \ [[GeneralContractor]],\u240A        [[HousePainter]], [[Locksmith]], [[Plumber]],\
      \ [[RoofingContractor]]. [[LegalService]] was introduced as a more inclusive\
      \ supertype of [[Attorney]]."
    is_a: sdos_LocalBusiness
    name: sdos_ProfessionalService
    title: ProfessionalService
