    is_a: sdos_CivicStructure
    name: sdos_PublicToilet
    source: https://github.com/schemaorg/schemaorg/issues/1624
    title: PublicToilet
  sdos_PublicationEvent:
    class_uri: sdos:PublicationEvent
    description: A PublicationEvent corresponds indifferently to the event of publication
      for a CreativeWork of any type, e.g. a broadcast event, an on-demand event,
      a book/journal publication via a variety of delivery media.
    is_a: sdos_Event
    name: sdos_PublicationEvent
    title: PublicationEvent
  sdos_PublicationIssue:
    class_uri: sdos:PublicationIssue
    contributors:
    - https://schema.org/docs/collab/bibex
    description: A part of a successively published publication such as a periodical
      or publication volume, often numbered, usually containing a grouping of works
      such as articles.\n\nSee also [blog post](https://blog-schema.org/2014/09/02/schema-org-support-for-bibliographic-relationships-and-periodicals/).
    is_a: sdos_CreativeWork
    name: sdos_PublicationIssue
    title: PublicationIssue
  sdos_PublicationVolume:
    class_uri: sdos:PublicationVolume
    contributors:
    - https://schema.org/docs/collab/bibex
    description: A part of a successively published publication such as a periodical
      or multi-volume work, often numbered. It may represent a time span, such as
      a year.\n\nSee also [blog post](https://blog-schema.org/2014/09/02/schema-org-support-for-bibliographic-relationships-and-periodicals/).
    is_a: sdos_CreativeWork
    name: sdos_PublicationVolume
    title: PublicationVolume
  sdos_PurchaseType:
    class_uri: sdos:PurchaseType
    description: Enumerates a purchase type for an item.
    is_a: sdos_Enumeration
    name: sdos_PurchaseType
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/3572
    title: PurchaseType
  sdos_QAPage:
    class_uri: sdos:QAPage
    description: A QAPage is a WebPage focussed on a specific Question and its Answer(s),
      e.g. in a question answering site or documenting Frequently Asked Questions
      (FAQs).
    is_a: sdos_WebPage
    name: sdos_QAPage
    title: QAPage
  sdos_QualitativeValue:
    class_uri: sdos:QualitativeValue
    contributors:
    - https://schema.org/docs/collab/GoodRelationsClass
    description: A predefined value for a product characteristic, e.g. the power cord
      plug type 'US' or the garment sizes 'S', 'M', 'L', and 'XL'.
    is_a: sdos_Enumeration
    name: sdos_QualitativeValue
    title: QualitativeValue
  sdos_QuantitativeValue:
    class_uri: sdos:QuantitativeValue
    contributors:
    - https://schema.org/docs/collab/GoodRelationsClass
    description: A point value or interval for product characteristics and other purposes.
    is_a: sdos_StructuredValue
    name: sdos_QuantitativeValue
    title: QuantitativeValue
  sdos_QuantitativeValueDistribution:
    class_uri: sdos:QuantitativeValueDistribution
    description: A statistical distribution of values.
    is_a: sdos_StructuredValue
    name: sdos_QuantitativeValueDistribution
    source: https://github.com/schemaorg/schemaorg/issues/1698
    title: QuantitativeValueDistribution
  sdos_Quantity:
    class_uri: sdos:Quantity
    description: Quantities such as distance, time, mass, weight, etc. Particular
      instances of say Mass are entities like '3 kg' or '4 milligrams'.
    is_a: sdos_Intangible
    name: sdos_Quantity
    title: Quantity
  sdos_Question:
    class_uri: sdos:Question
    contributors:
    - https://schema.org/docs/collab/QAStackExchange
    description: A specific question - e.g. from a user seeking answers online, or
      collected in a Frequently Asked Questions (FAQ) document.
    is_a: sdos_Comment
    name: sdos_Question
    title: Question
  sdos_Quiz:
    class_uri: sdos:Quiz
    description: 'Quiz: A test of knowledge, skills and abilities.'
    is_a: sdos_LearningResource
    name: sdos_Quiz
    source: https://github.com/schemaorg/schemaorg/issues/2611
    title: Quiz
  sdos_Quotation:
    class_uri: sdos:Quotation
    description: A quotation. Often but not necessarily from some written work, attributable
      to a real world author and - if associated with a fictional character - to any
      fictional Person. Use [[isBasedOn]] to link to source/origin. The [[recordedIn]]
      property can be used to reference a Quotation from an [[Event]].
    is_a: sdos_CreativeWork
    name: sdos_Quotation
    source: https://github.com/schemaorg/schemaorg/issues/271
    title: Quotation
  sdos_QuoteAction:
    class_uri: sdos:QuoteAction
    description: An agent quotes/estimates/appraises an object/product/service with
      a price at a location/store.
    is_a: sdos_TradeAction
    name: sdos_QuoteAction
    title: QuoteAction
  sdos_RVPark:
    class_uri: sdos:RVPark
    description: A place offering space for "Recreational Vehicles", Caravans, mobile
      homes and the like.
    is_a: sdos_CivicStructure
    name: sdos_RVPark
    title: RVPark
  sdos_RadiationTherapy:
    class_uri: sdos:RadiationTherapy
    description: A process of care using radiation aimed at improving a health condition.
    is_a: sdos_MedicalTherapy
    name: sdos_RadiationTherapy
    title: RadiationTherapy
  sdos_RadioBroadcastService:
    class_uri: sdos:RadioBroadcastService
    description: A delivery service through which radio content is provided via broadcast
      over the air or online.
    is_a: sdos_BroadcastService
    name: sdos_RadioBroadcastService
    source: https://github.com/schemaorg/schemaorg/issues/2109
    title: RadioBroadcastService
  sdos_RadioChannel:
    class_uri: sdos:RadioChannel
    description: A unique instance of a radio BroadcastService on a CableOrSatelliteService
      lineup.
    is_a: sdos_BroadcastChannel
    name: sdos_RadioChannel
    title: RadioChannel
  sdos_RadioClip:
    class_uri: sdos:RadioClip
    description: A short radio program or a segment/part of a radio program.
    is_a: sdos_Clip
    name: sdos_RadioClip
    title: RadioClip
  sdos_RadioEpisode:
    class_uri: sdos:RadioEpisode
    description: A radio episode which can be part of a series or season.
    is_a: sdos_Episode
    name: sdos_RadioEpisode
    title: RadioEpisode
  sdos_RadioSeason:
    class_uri: sdos:RadioSeason
    description: Season dedicated to radio broadcast and associated online delivery.
    is_a: sdos_CreativeWorkSeason
    name: sdos_RadioSeason
    title: RadioSeason
  sdos_RadioSeries:
    class_uri: sdos:RadioSeries
    description: CreativeWorkSeries dedicated to radio broadcast and associated online
      delivery.
    is_a: sdos_CreativeWorkSeries
    name: sdos_RadioSeries
    title: RadioSeries
  sdos_RadioStation:
    class_uri: sdos:RadioStation
    description: A radio station.
    is_a: sdos_LocalBusiness
    name: sdos_RadioStation
    title: RadioStation
  sdos_Rating:
    class_uri: sdos:Rating
    description: A rating is an evaluation on a numeric scale, such as 1 to 5 stars.
    is_a: sdos_Intangible
    name: sdos_Rating
    title: Rating
  sdos_ReactAction:
    class_uri: sdos:ReactAction
    description: The act of responding instinctively and emotionally to an object,
      expressing a sentiment.
    is_a: sdos_AssessAction
    name: sdos_ReactAction
    title: ReactAction
  sdos_ReadAction:
    class_uri: sdos:ReadAction
    description: The act of consuming written content.
    is_a: sdos_ConsumeAction
    name: sdos_ReadAction
    title: ReadAction
  sdos_RealEstateAgent:
    class_uri: sdos:RealEstateAgent
    description: A real-estate agent.
    is_a: sdos_LocalBusiness
    name: sdos_RealEstateAgent
    title: RealEstateAgent
  sdos_RealEstateListing:
    class_uri: sdos:RealEstateListing
    description: "A [[RealEstateListing]] is a listing that describes one or more\
      \ real-estate [[Offer]]s (whose [[businessFunction]] is typically to lease out,\
      \ or to sell).\u240A  The [[RealEstateListing]] type itself represents the overall\
      \ listing, as manifested in some [[WebPage]]."
    is_a: sdos_WebPage
    name: sdos_RealEstateListing
    source: https://github.com/schemaorg/schemaorg/issues/2348
    title: RealEstateListing
  sdos_ReceiveAction:
    class_uri: sdos:ReceiveAction
    description: 'The act of physically/electronically taking delivery of an object
      that has been transferred from an origin to a destination. Reciprocal of SendAction.\n\nRelated
      actions:\n\n* [[SendAction]]: The reciprocal of ReceiveAction.\n* [[TakeAction]]:
      Unlike TakeAction, ReceiveAction does not imply that the ownership has been
      transferred (e.g. I can receive a package, but it does not mean the package
      is now mine).'
    is_a: sdos_TransferAction
    name: sdos_ReceiveAction
    title: ReceiveAction
  sdos_Recipe:
    class_uri: sdos:Recipe
    description: A recipe. For dietary restrictions covered by the recipe, a few common
      restrictions are enumerated via [[suitableForDiet]]. The [[keywords]] property
      can also be used to add more detail.
    is_a: sdos_HowTo
    name: sdos_Recipe
    title: Recipe
  sdos_Recommendation:
    class_uri: sdos:Recommendation
    description: '[[Recommendation]] is a type of [[Review]] that suggests or proposes
      something as the best option or best course of action. Recommendations may be
      for products or services, or other concrete things, as in the case of a ranked
      list or product guide. A [[Guide]] may list multiple recommendations for different
      categories. For example, in a [[Guide]] about which TVs to buy, the author may
      have several [[Recommendation]]s.'
    is_a: sdos_Review
    name: sdos_Recommendation
    source: https://github.com/schemaorg/schemaorg/issues/2405
    title: Recommendation
  sdos_RecommendedDoseSchedule:
    class_uri: sdos:RecommendedDoseSchedule
    description: A recommended dosing schedule for a drug or supplement as prescribed
      or recommended by an authority or by the drug/supplement's manufacturer. Capture
      the recommending authority in the recognizingAuthority property of MedicalEntity.
    is_a: sdos_DoseSchedule
    name: sdos_RecommendedDoseSchedule
    title: RecommendedDoseSchedule
  sdos_RecyclingCenter:
    class_uri: sdos:RecyclingCenter
    description: A recycling center.
    is_a: sdos_LocalBusiness
    name: sdos_RecyclingCenter
    title: RecyclingCenter
  sdos_RefundTypeEnumeration:
    class_uri: sdos:RefundTypeEnumeration
    description: Enumerates several kinds of product return refund types.
    is_a: sdos_Enumeration
    name: sdos_RefundTypeEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2288
    title: RefundTypeEnumeration
  sdos_RegisterAction:
    class_uri: sdos:RegisterAction
    description: 'The act of registering to be a user of a service, product or web
      page.\n\nRelated actions:\n\n* [[JoinAction]]: Unlike JoinAction, RegisterAction
      implies you are registering to be a user of a service, *not* a group/team of
      people.\n* [[FollowAction]]: Unlike FollowAction, RegisterAction doesn''t imply
      that the agent is expecting to poll for updates from the object.\n* [[SubscribeAction]]:
      Unlike SubscribeAction, RegisterAction doesn''t imply that the agent is expecting
      updates from the object.'
    is_a: sdos_InteractAction
    name: sdos_RegisterAction
    title: RegisterAction
  sdos_RejectAction:
    class_uri: sdos:RejectAction
    description: 'The act of rejecting to/adopting an object.\n\nRelated actions:\n\n*
      [[AcceptAction]]: The antonym of RejectAction.'
    is_a: sdos_AllocateAction
    name: sdos_RejectAction
    title: RejectAction
  sdos_RentAction:
    class_uri: sdos:RentAction
    description: The act of giving money in return for temporary use, but not ownership,
      of an object such as a vehicle or property. For example, an agent rents a property
      from a landlord in exchange for a periodic payment.
    is_a: sdos_TradeAction
    name: sdos_RentAction
    title: RentAction
  sdos_RentalCarReservation:
    class_uri: sdos:RentalCarReservation
    description: 'A reservation for a rental car.\n\nNote: This type is for information
      about actual reservations, e.g. in confirmation emails or HTML pages with individual
      confirmations of reservations.'
    is_a: sdos_Reservation
    name: sdos_RentalCarReservation
    title: RentalCarReservation
  sdos_RepaymentSpecification:
    class_uri: sdos:RepaymentSpecification
    contributors:
    - https://schema.org/docs/collab/FIBO
    description: A structured value representing repayment.
    is_a: sdos_StructuredValue
    name: sdos_RepaymentSpecification
    source: https://github.com/schemaorg/schemaorg/issues/1253
    title: RepaymentSpecification
  sdos_ReplaceAction:
    class_uri: sdos:ReplaceAction
    description: The act of editing a recipient by replacing an old object with a
      new object.
    is_a: sdos_UpdateAction
    name: sdos_ReplaceAction
    title: ReplaceAction
  sdos_ReplyAction:
    class_uri: sdos:ReplyAction
    description: 'The act of responding to a question/message asked/sent by the object.
      Related to [[AskAction]].\n\nRelated actions:\n\n* [[AskAction]]: Appears generally
      as an origin of a ReplyAction.'
    is_a: sdos_CommunicateAction
    name: sdos_ReplyAction
    title: ReplyAction
  sdos_Report:
    class_uri: sdos:Report
    description: A Report generated by governmental or non-governmental organization.
    is_a: sdos_Article
    name: sdos_Report
    title: Report
  sdos_ReportageNewsArticle:
    class_uri: sdos:ReportageNewsArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: "The [[ReportageNewsArticle]] type is a subtype of [[NewsArticle]]\
      \ representing\u240A news articles which are the result of journalistic news\
      \ reporting conventions.\u240A\u240AIn practice many news publishers produce\
      \ a wide variety of article types, many of which might be considered a [[NewsArticle]]\
      \ but not a [[ReportageNewsArticle]]. For example, opinion pieces, reviews,\
      \ analysis, sponsored or satirical articles, or articles that combine several\
      \ of these elements.\u240A\u240AThe [[ReportageNewsArticle]] type is based on\
      \ a stricter ideal for \"news\" as a work of journalism, with articles based\
      \ on factual information either observed or verified by the author, or reported\
      \ and verified from knowledgeable sources.  This often includes perspectives\
      \ from multiple viewpoints on a particular issue (distinguishing news reports\
      \ from public relations or propaganda).  News reports in the [[ReportageNewsArticle]]\
      \ sense de-emphasize the opinion of the author, with commentary and value judgements\
      \ typically expressed elsewhere.\u240A\u240AA [[ReportageNewsArticle]] which\
      \ goes deeper into analysis can also be marked with an additional type of [[AnalysisNewsArticle]]."
    is_a: sdos_NewsArticle
    name: sdos_ReportageNewsArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: ReportageNewsArticle
  sdos_ReportedDoseSchedule:
    class_uri: sdos:ReportedDoseSchedule
    description: A patient-reported or observed dosing schedule for a drug or supplement.
    is_a: sdos_DoseSchedule
    name: sdos_ReportedDoseSchedule
    title: ReportedDoseSchedule
  sdos_ResearchOrganization:
    class_uri: sdos:ResearchOrganization
    description: A Research Organization (e.g. scientific institute, research company).
    is_a: sdos_Organization
    name: sdos_ResearchOrganization
    source: https://github.com/schemaorg/schemaorg/issues/2877
    title: ResearchOrganization
  sdos_ResearchProject:
    class_uri: sdos:ResearchProject
    comments:
    - 'source: https://schema.org/docs/collab/FundInfoCollab'
    description: A Research project.
    is_a: sdos_Project
    name: sdos_ResearchProject
    source: https://github.com/schemaorg/schemaorg/issues/383
    title: ResearchProject
  sdos_Researcher:
    class_uri: sdos:Researcher
    description: Researchers.
    is_a: sdos_Audience
    name: sdos_Researcher
    title: Researcher
  sdos_Reservation:
    class_uri: sdos:Reservation
    description: 'Describes a reservation for travel, dining or an event. Some reservations
      require tickets. \n\nNote: This type is for information about actual reservations,
      e.g. in confirmation emails or HTML pages with individual confirmations of reservations.
      For offers of tickets, restaurant reservations, flights, or rental cars, use
      [[Offer]].'
    is_a: sdos_Intangible
    name: sdos_Reservation
    title: Reservation
  sdos_ReservationPackage:
    class_uri: sdos:ReservationPackage
    description: A group of multiple reservations with common values for all sub-reservations.
    is_a: sdos_Reservation
    name: sdos_ReservationPackage
    title: ReservationPackage
  sdos_ReservationStatusType:
    class_uri: sdos:ReservationStatusType
    description: Enumerated status values for Reservation.
    is_a: sdos_StatusEnumeration
    name: sdos_ReservationStatusType
    slots:
    - rdfs_comment
    - rdfs_label
    title: ReservationStatusType
  sdos_ReserveAction:
    class_uri: sdos:ReserveAction
    description: 'Reserving a concrete object.\n\nRelated actions:\n\n* [[ScheduleAction]]:
      Unlike ScheduleAction, ReserveAction reserves concrete objects (e.g. a table,
      a hotel) towards a time slot / spatial allocation.'
    is_a: sdos_PlanAction
    name: sdos_ReserveAction
    title: ReserveAction
  sdos_Reservoir:
    class_uri: sdos:Reservoir
    description: A reservoir of water, typically an artificially created lake, like
      the Lake Kariba reservoir.
    is_a: sdos_BodyOfWater
    name: sdos_Reservoir
    title: Reservoir
  sdos_Residence:
    class_uri: sdos:Residence
    description: The place where a person lives.
    is_a: sdos_Place
    name: sdos_Residence
    title: Residence
  sdos_Resort:
    class_uri: sdos:Resort
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: "A resort is a place used for relaxation or recreation, attracting\
      \ visitors for holidays or vacations. Resorts are places, towns or sometimes\
      \ commercial establishments operated by a single company (source: Wikipedia,\
      \ the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Resort\"\
      >http://en.wikipedia.org/wiki/Resort</a>).\u240A<br /><br />\u240ASee also the\
      \ <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org\
      \ for marking up hotels and other forms of accommodations</a>."
    is_a: sdos_LodgingBusiness
    name: sdos_Resort
    title: Resort
  sdos_Restaurant:
    class_uri: sdos:Restaurant
    description: A restaurant.
    is_a: sdos_FoodEstablishment
    name: sdos_Restaurant
    title: Restaurant
  sdos_RestrictedDiet:
    class_uri: sdos:RestrictedDiet
    description: A diet restricted to certain foods or preparations for cultural,
      religious, health or lifestyle reasons.
    is_a: sdos_Enumeration
    name: sdos_RestrictedDiet
    slots:
    - rdfs_comment
    - rdfs_label
    title: RestrictedDiet
  sdos_ResumeAction:
    class_uri: sdos:ResumeAction
    description: The act of resuming a device or application which was formerly paused
      (e.g. resume music playback or resume a timer).
    is_a: sdos_ControlAction
    name: sdos_ResumeAction
    title: ResumeAction
  sdos_ReturnAction:
    class_uri: sdos:ReturnAction
    description: The act of returning to the origin that which was previously received
      (concrete objects) or taken (ownership).
    is_a: sdos_TransferAction
    name: sdos_ReturnAction
    title: ReturnAction
  sdos_ReturnFeesEnumeration:
    class_uri: sdos:ReturnFeesEnumeration
    description: Enumerates several kinds of policies for product return fees.
    is_a: sdos_Enumeration
    name: sdos_ReturnFeesEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2288
    title: ReturnFeesEnumeration
  sdos_ReturnLabelSourceEnumeration:
    class_uri: sdos:ReturnLabelSourceEnumeration
    description: Enumerates several types of return labels for product returns.
    is_a: sdos_Enumeration
    name: sdos_ReturnLabelSourceEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2880
    title: ReturnLabelSourceEnumeration
  sdos_ReturnMethodEnumeration:
    class_uri: sdos:ReturnMethodEnumeration
    description: Enumerates several types of product return methods.
    is_a: sdos_Enumeration
    name: sdos_ReturnMethodEnumeration
    slots:
    - rdfs_comment
    - sdos_source
    - sdos_isPartOf
    - rdfs_label
    source: https://github.com/schemaorg/schemaorg/issues/2880
    title: ReturnMethodEnumeration
  sdos_Review:
    class_uri: sdos:Review
    description: A review of an item - for example, of a restaurant, movie, or store.
    is_a: sdos_CreativeWork
    name: sdos_Review
    title: Review
  sdos_ReviewAction:
    class_uri: sdos:ReviewAction
    description: The act of producing a balanced opinion about the object for an audience.
      An agent reviews an object with participants resulting in a review.
    is_a: sdos_AssessAction
    name: sdos_ReviewAction
    title: ReviewAction
  sdos_ReviewNewsArticle:
    class_uri: sdos:ReviewNewsArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: A [[NewsArticle]] and [[CriticReview]] providing a professional critic's
      assessment of a service, product, performance, or artistic or literary work.
    is_a: sdos_NewsArticle
    name: sdos_ReviewNewsArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: ReviewNewsArticle
  sdos_RiverBodyOfWater:
    class_uri: sdos:RiverBodyOfWater
    description: A river (for example, the broad majestic Shannon).
    is_a: sdos_BodyOfWater
    name: sdos_RiverBodyOfWater
    title: RiverBodyOfWater
  sdos_Role:
    class_uri: sdos:Role
    description: Represents additional information about a relationship or property.
      For example a Role can be used to say that a 'member' role linking some SportsTeam
      to a player occurred during a particular time period. Or that a Person's 'actor'
      role in a Movie was for some particular characterName. Such properties can be
      attached to a Role entity, which is then associated with the main entities using
      ordinary properties like 'member' or 'actor'.\n\nSee also [blog post](http://blog.schema.org/2014/06/introducing-role.html).
    is_a: sdos_Intangible
    name: sdos_Role
    title: Role
  sdos_RoofingContractor:
    class_uri: sdos:RoofingContractor
    description: A roofing contractor.
    is_a: sdos_HomeAndConstructionBusiness
    name: sdos_RoofingContractor
    title: RoofingContractor
  sdos_Room:
    class_uri: sdos:Room
    contributors:
    - https://schema.org/docs/collab/STI_Accommodation_Ontology
    description: "A room is a distinguishable space within a structure, usually separated\
      \ from other spaces by interior walls (source: Wikipedia, the free encyclopedia,\
      \ see <a href=\"http://en.wikipedia.org/wiki/Room\">http://en.wikipedia.org/wiki/Room</a>).\u240A\
      <br /><br />\u240ASee also the <a href=\"/docs/hotels.html\">dedicated document\
      \ on the use of schema.org for marking up hotels and other forms of accommodations</a>."
    is_a: sdos_Accommodation
    name: sdos_Room
    title: Room
  sdos_RsvpAction:
    class_uri: sdos:RsvpAction
    description: The act of notifying an event organizer as to whether you expect
      to attend the event.
    is_a: sdos_InformAction
    name: sdos_RsvpAction
    title: RsvpAction
  sdos_RsvpResponseType:
    class_uri: sdos:RsvpResponseType
    description: RsvpResponseType is an enumeration type whose instances represent
      responding to an RSVP request.
    is_a: sdos_Enumeration
    name: sdos_RsvpResponseType
    slots:
    - rdfs_comment
    - rdfs_label
    title: RsvpResponseType
  sdos_SaleEvent:
    class_uri: sdos:SaleEvent
    description: 'Event type: Sales event.'
    is_a: sdos_Event
    name: sdos_SaleEvent
    title: SaleEvent
  sdos_SatiricalArticle:
    class_uri: sdos:SatiricalArticle
    contributors:
    - https://schema.org/docs/collab/TP
    description: An [[Article]] whose content is primarily [[satirical]](https://en.wikipedia.org/wiki/Satire)
      in nature, i.e. unlikely to be literally true. A satirical article is sometimes
      but not necessarily also a [[NewsArticle]]. [[ScholarlyArticle]]s are also sometimes
      satirized.
    is_a: sdos_Article
    name: sdos_SatiricalArticle
    source: https://github.com/schemaorg/schemaorg/issues/1525
    title: SatiricalArticle
  sdos_Schedule:
    class_uri: sdos:Schedule
    description: "A schedule defines a repeating time period used to describe a regularly\
      \ occurring [[Event]]. At a minimum a schedule will specify [[repeatFrequency]]\
      \ which describes the interval between occurrences of the event. Additional\
      \ information can be provided to specify the schedule more precisely.\u240A\
      \      This includes identifying the day(s) of the week or month when the recurring\
      \ event will take place, in addition to its start and end time. Schedules may\
      \ also\u240A      have start and end dates to indicate when they are active,\
      \ e.g. to define a limited calendar of events."
    is_a: sdos_Intangible
    name: sdos_Schedule
