  sdos_StatisticalPopulation:
    class_uri: sdos:StatisticalPopulation
    description: "A StatisticalPopulation is a set of instances of a certain given\
      \ type that satisfy some set of constraints. The property [[populationType]]\
      \ is used to specify the type. Any property that can be used on instances of\
      \ that type can appear on the statistical population. For example, a [[StatisticalPopulation]]\
      \ representing all [[Person]]s with a [[homeLocation]] of East Podunk California\
      \ would be described by applying the appropriate [[homeLocation]] and [[populationType]]\
      \ properties to a [[StatisticalPopulation]] item that stands for that set of\
      \ people.\u240AThe properties [[numConstraints]] and [[constraintProperty]]\
      \ are used to specify which of the populations properties are used to specify\
      \ the population. Note that the sense of \"population\" used here is the general\
      \ sense of a statistical\u240Apopulation, and does not imply that the population\
      \ consists of people. For example, a [[populationType]] of [[Event]] or [[NewsArticle]]\
      \ could be used. See also [[Observation]], where a [[populationType]] such as\
      \ [[Person]] or [[Event]] can be indicated directly. In most cases it may be\
      \ better to use [[StatisticalVariable]] instead of [[StatisticalPopulation]]."
    is_a: sdos_Intangible
    name: sdos_StatisticalPopulation
    source: https://github.com/schemaorg/schemaorg/issues/2291
    title: StatisticalPopulation
  sdos_StatisticalVariable:
    class_uri: sdos:StatisticalVariable
    description: '[[StatisticalVariable]] represents any type of statistical metric
      that can be measured at a place and time. The usage pattern for [[StatisticalVariable]]
      is typically expressed using [[Observation]] with an explicit [[populationType]],
      which is a type, typically drawn from Schema.org. Each [[StatisticalVariable]]
      is marked as a [[ConstraintNode]], meaning that some properties (those listed
      using [[constraintProperty]]) serve in this setting solely to define the statistical
      variable rather than literally describe a specific person, place or thing. For
      example, a [[StatisticalVariable]] Median_Height_Person_Female representing
      the median height of women, could be written as follows: the population type
      is [[Person]]; the measuredProperty [[height]]; the [[statType]] [[median]];
      the [[gender]] [[Female]]. It is important to note that there are many kinds
      of scientific quantitative observation which are not fully, perfectly or unambiguously
      described following this pattern, or with solely Schema.org terminology. The
      approach taken here is designed to allow partial, incremental or minimal description
      of [[StatisticalVariable]]s, and the use of detailed sets of entity and property
      IDs from external repositories. The [[measurementMethod]], [[unitCode]] and
      [[unitText]] properties can also be used to clarify the specific nature and
      notation of an observed measurement.'
    is_a: sdos_ConstraintNode
    name: sdos_StatisticalVariable
    source: https://github.com/schemaorg/schemaorg/issues/2564
    title: StatisticalVariable
