  sdos_incentiveAmount:
    any_of:
    - range: sdos_QuantitativeValue
    - range: sdos_LoanOrCredit
    - range: sdos_UnitPriceSpecification
    comments:
    - No occurrences of this slot in the graph.
    description: "Describes the amount that can be redeemed from this incentive.\u240A\
      \    \u240A<p>[[QuantitativeValue]]: Use this for incentives based on price\
      \ (either raw amount or percentage-based). For a raw amount example, \"You can\
      \ claim $2,500 - $7,500 from the total cost of installation\" would be represented\
      \ as the following:</p>\u240A    {\u240A        \"@type\": \"QuantitativeValue\"\
      ,\u240A        \u201CminValue\u201D: 2500,\u240A        \u201CmaxValue\u201D\
      : 7500,\u240A        \"unitCode\": \"USD\"\u240A    }\u240A<p>[[QuantitivateValue]]\
      \ can also be used for percentage amounts. In such cases, value is used to represent\
      \ the incentive\u2019s percentage, while maxValue represents a limit (if one\
      \ exists) to that incentive. The unitCode should be 'P1' and the unitText should\
      \ be '%', while valueReference should be used for holding the currency type.\
      \ For example, \"You can claim up to 30% of the total cost of installation,\
      \ up to a maximum of $7,500\" would be:</p>\u240A    {\u240A        \"@type\"\
      : \"QuantitativeValue\",\u240A        \"value\": 30,\u240A        \"unitCode\"\
      : \"P1\",\u240A        \"unitText\": \"%\",\u240A        \u201CmaxValue\u201D\
      : 7500,\u240A        \u201CvalueReference\u201D: \u201CUSD\u201D\u240A    }\u240A\
      <p>[[UnitPriceSpecification]]: Use this for incentives that are based on amounts\
      \ rather than price. For example, a net metering rebate that pays $10/kWh, up\
      \ to $1,000:</p>\u240A    {\u240A        \"@type\": \"UnitPriceSpecification\"\
      ,\u240A        \"price\": 10,\u240A        \"priceCurrency\": \"USD\",\u240A\
      \        \"referenceQuantity\": 1,\u240A        \"unitCode\": \"DO3\",\u240A\
      \        \"unitText\": \"kw/h\",\u240A        \"maxPrice\": 1000,\u240A    \
      \    \"description\": \"$10 / kwh up to $1000\"\u240A    }\u240A<p>[[LoanOrCredit]]:\
      \ Use for incentives that are loan based. For example, a loan of $4,000 - $50,000\
      \ with a repayment term of 10 years, interest free would look like:</p>\u240A\
      \    {\u240A        \"@type\": \"LoanOrCredit\",\u240A        \"loanTerm\":\
      \ {\u240A                \"@type\":\"QuantitativeValue\",\u240A            \
      \    \"value\":\"10\",\u240A                \"unitCode\": \"ANN\"\u240A    \
      \        },\u240A        \"amount\":[\u240A            {\u240A             \
      \   \"@type\": \"QuantitativeValue\",\u240A                \"Name\":\"fixed\
      \ interest rate\",\u240A                \"value\":\"0\",\u240A            },\u240A\
      \        ],\u240A        \"amount\":[\u240A            {\u240A             \
      \   \"@type\": \"MonetaryAmount\",\u240A                \"Name\":\"min loan\
      \ amount\",\u240A                \"value\":\"4000\",\u240A                \"\
      currency\":\"CAD\"\u240A            },\u240A            {\u240A            \
      \    \"@type\": \"MonetaryAmount\",\u240A                \"Name\":\"max loan\
      \ amount\",\u240A                \"value\":\"50000\",\u240A                \"\
      currency\":\"CAD\"\u240A            }\u240A        ],\u240A    }\u240A\u240A\
      In summary: <ul><li>Use [[QuantitativeValue]] for absolute/percentage-based\
      \ incentives applied on the price of a good/service.</li>\u240A<li>Use [[UnitPriceSpecification]]\
      \ for incentives based on a per-unit basis (e.g. net metering).</li>\u240A<li>Use\
      \ [[LoanOrCredit]] for loans/credits.</li>\u240A</ul>."
    domain: sdos_FinancialIncentive
    name: sdos_incentiveAmount
    range: Any
    slot_uri: sdos:incentiveAmount
    source: https://github.com/schemaorg/schemaorg/issues/3572
    title: incentiveAmount
