    - range: sdos_Text
    comments:
    - No occurrences of this slot in the graph.
    description: "A technique, method or technology used in an [[Observation]], [[StatisticalVariable]]\
      \ or [[Dataset]] (or [[DataDownload]], [[DataCatalog]]), corresponding to the\
      \ method used for measuring the corresponding variable(s) (for datasets, described\
      \ using [[variableMeasured]]; for [[Observation]], a [[StatisticalVariable]]).\
      \ Often but not necessarily each [[variableMeasured]] will have an explicit\
      \ representation as (or mapping to) an property such as those defined in Schema.org,\
      \ or other RDF vocabularies and \"knowledge graphs\". In that case the subproperty\
      \ of [[variableMeasured]] called [[measuredProperty]] is applicable.\u240A \
      \   \u240AThe [[measurementTechnique]] property helps when extra clarification\
      \ is needed about how a [[measuredProperty]] was measured. This is oriented\
      \ towards scientific and scholarly dataset publication but may have broader\
      \ applicability; it is not intended as a full representation of measurement,\
      \ but can often serve as a high level summary for dataset discovery. \u240A\u240A\
      For example, if [[variableMeasured]] is: molecule concentration, [[measurementTechnique]]\
      \ could be: \"mass spectrometry\" or \"nmr spectroscopy\" or \"colorimetry\"\
      \ or \"immunofluorescence\". If the [[variableMeasured]] is \"depression rating\"\
      , the [[measurementTechnique]] could be \"Zung Scale\" or \"HAM-D\" or \"Beck\
      \ Depression Inventory\". \u240A\u240AIf there are several [[variableMeasured]]\
      \ properties recorded for some given data object, use a [[PropertyValue]] for\
      \ each [[variableMeasured]] and attach the corresponding [[measurementTechnique]].\
      \ The value can also be from an enumeration, organized as a [[MeasurementMetholdEnumeration]]."
