  sdos_mobileUrl:
    comments:
    - No occurrences of this slot in the graph.
    description: "The [[mobileUrl]] property is provided for specific situations in\
      \ which data consumers need to determine whether one of several provided URLs\
      \ is a dedicated 'mobile site'.\u240A\u240ATo discourage over-use, and reflecting\
      \ intial usecases, the property is expected only on [[Product]] and [[Offer]],\
      \ rather than [[Thing]]. The general trend in web technology is towards [responsive\
      \ design](https://en.wikipedia.org/wiki/Responsive_web_design) in which content\
      \ can be flexibly adapted to a wide range of browsing environments. Pages and\
      \ sites referenced with the long-established [[url]] property should ideally\
      \ also be usable on a wide variety of devices, including mobile phones. In most\
      \ cases, it would be pointless and counter productive to attempt to update all\
      \ [[url]] markup to use [[mobileUrl]] for more mobile-oriented pages. The property\
      \ is intended for the case when items (primarily [[Product]] and [[Offer]])\
      \ have extra URLs hosted on an additional \"mobile site\" alongside the main\
      \ one. It should not be taken as an endorsement of this publication style."
    name: sdos_mobileUrl
    range: sdos_Text
    slot_uri: sdos:mobileUrl
    source: https://github.com/schemaorg/schemaorg/issues/3134
    title: mobileUrl
    union_of:
