    description: "Indicates sections of a Web page that are particularly 'speakable'\
      \ in the sense of being highlighted as being especially appropriate for text-to-speech\
      \ conversion. Other sections of a page may also be usefully spoken in particular\
      \ circumstances; the 'speakable' property serves to indicate the parts most\
      \ likely to be generally useful for speech.\u240A\u240AThe *speakable* property\
      \ can be repeated an arbitrary number of times, with three kinds of possible\
      \ 'content-locator' values:\u240A\u240A1.) *id-value* URL references - uses\
      \ *id-value* of an element in the page being annotated. The simplest use of\
      \ *speakable* has (potentially relative) URL values, referencing identified\
      \ sections of the document concerned.\u240A\u240A2.) CSS Selectors - addresses\
      \ content in the annotated page, e.g. via class attribute. Use the [[cssSelector]]\
      \ property.\u240A\u240A3.)  XPaths - addresses content via XPaths (assuming\
      \ an XML view of the content). Use the [[xpath]] property.\u240A\u240A\u240A\
      For more sophisticated markup of speakable sections beyond simple ID references,\
      \ either CSS selectors or XPath expressions to pick out document section(s)\
      \ as speakable. For this\u240Awe define a supporting type, [[SpeakableSpecification]]\
      \  which is defined to be a possible value of the *speakable* property."
    name: sdos_speakable
    range: Any
    slot_uri: sdos:speakable
    source: https://github.com/schemaorg/schemaorg/issues/1389
